  {name: "Treefort Music Festival 2016", latitude: 43.6187102, longitude: -116.21460680000001, start_date: "2016-03-23", date: "March 23-27, 2016", location: "Boise, ID", website: "http://treefortmusicfest.com/#/", description: "Boise in Idaho may sound like an odd city choice for an epic festival, but the Treefort Festival continues to impress us year after year. Treefort typically takes place the week after SXSW to take advantage of artists heading back to the Northwest. Short lines and a welcoming city continually keeps Treefort at the top of our list. Since their inception, the festival has grown in size to include film, yoga, beer, and comedy. \r\n", price: 0, camping: " No", end_date: "2016-03-27"},
  {name: "DGTL Festival 2016", latitude: 52.4010604, longitude: 4.889499800000067, start_date: "2016-03-26", date: "March 26-27, 2016", location: "Amsterdam, The Netherlands", website: "http://dgtl.nl/home/", description: nil, price: 0, camping: " Yes", end_date: "2016-03-27"},
  {name: "Paaspop 2016", latitude: 51.6406352, longitude: 5.417799000000059, start_date: "2016-03-25", date: "March 25-27, 2016", location: "Schijndel, Netherlands", website: "http://www.paaspop.nl/", description: "No matter what type of music you like, Paaspop has it all. There are 12 different stages, offering anything from rock to hiphop, house to theatre and pop to metal. Apart from that there’s an incredible amount of other cool things to experience. With 50,000 visitors and more than 175 acts every edition is an incredible party.\r\n", price: 0, camping: " Yes", end_date: "2016-03-27"},
  {name: "Byron Bay Bluesfest 2016", latitude: -28.6441616, longitude: 153.6123788, start_date: "2016-03-24", date: "March 24-28, 2016", location: "Byron Bay, Australia", website: "http://www.bluesfest.com.au/", description: nil, price: 0, camping: " Yes", end_date: "2016-03-28"},
  {name: "Big Ears 2016", latitude: 35.9606384, longitude: -83.92073920000001, start_date: "2016-03-31", date: "March 31- April 2, 2016", location: "Knoxville, TN", website: "http://www.bigearsfestival.com/", description: "Big Ears brings together musicians and artists who span generations and transcend genres for dozens of concerts along with installations, exhibitions, film screenings, interactive workshops, informative talks, surprise collaborations, and unexpected connections. \r\n", price: 0, camping: " No", end_date: "2016-04-02"},
