  {name: "Fool’s Paradise 2016", latitude: 29.90124370000001, longitude: -81.31243410000002, start_date: "2016-04-01", date: "April 1-2, 2016", location: "St. Augustine, FL", website: "http://www.foolsparadisefl.com/", description: "Fool’s Paradise is bringing your favorite bands to the beach. For two full days, there will be genre-bending music, artist-led excursions, musical workshops, yoga and activities just steps from the ocean.  In addition, a number of late night shows will be hosted by some of the most talented musicians in the industry! \r\n", price: 0, camping: " Yes", end_date: "2016-04-02"},
  {name: "Tallinn Music Week 2016", latitude: 59.43696079999999, longitude: 24.75357459999998, start_date: "2016-03-28", date: "March 28-April 4, 2016", location: "Tallinn, Estonia", website: "http://tmw.ee/", description: "TMW is an annually held music industry conference and the biggest indoor festival in the Baltic-Nordic region.\r\n", price: 40, camping: " No", end_date: "2016-04-04"},
  {name: "Lost & Found 2016", latitude: 35.9574032, longitude: 14.421479500000032, start_date: "2016-03-31", date: "March 31- April 3, 2016", location: "San Pawl il-Baħar, Malta", website: "http://lostandfoundfestival.com/", description: nil, price: 0, camping: " No", end_date: "2016-04-03"},
  {name: "Phoenix Lights 2016", latitude: 33.4483771, longitude: -112.07403729999999, start_date: "2016-04-02", date: "April 2-3, 2016", location: "Phoenix, AZ", website: "http://phoenixlightsfest.com/", description: nil, price: 0, camping: " No", end_date: "2016-04-03"},
  {name: "Desert Hearts 2016", latitude: 33.2552896, longitude: -116.56362869999998, start_date: "2016-04-01", date: "April 1-4, 2016", location: "Los Coyotes Indian Reservation, CA", website: "http://www.deserthearts.us/", description: "Desert Hearts is a bi-annual music and arts festival. We are a community, a movement of love celebrating life with beats. A place where acceptance, creativity and passions flourish. We are an intimate gathering of open-minded and like-minded individuals where friendships blossom and smiles surround you. A place to learn, grow, inspire and release. A safe haven away from Babylon where everyone can connect with nature, be themselves and do what makes then happy. One stage, one vibe, and one beautiful growing family.   House, Techno and Love was the foundation for our first small renegade in the Mojave and has continued to be the basis for our gatherings. We have come a long way since the birth of Desert Hearts and although our family has grown, our vibe and high standard of music has stayed true to our values.\r\n", price: 0, camping: " Yes", end_date: "2016-04-04"},
  {name: "Savannah Music Festival 2016", latitude: 32.0835407, longitude: -81.09983419999998, start_date: "2016-03-24", date: "March 24- April 9, 2016", location: "Savannah, GA", website: "http://www.savannahmusicfestival.org/", description: "THE SAVANNAH MUSIC FESTIVAL IS DEDICATED TO PRESENTING A WORLD-CLASS CELEBRATION OF THE MUSICAL ARTS BY CREATING TIMELESS AND ADVENTUROUS PRODUCTIONS THAT STIMULATE ARTS EDUCATION, FOSTER ECONOMIC GROWTH, AND UNITE ARTISTS AND AUDIENCES IN SAVANNAH. IT IS THE LARGEST MUSICAL ARTS EVENT IN GEORGIA AND ONE OF THE MOST DISTINCTIVE CROSS-GENRE MUSIC FESTIVALS IN THE WORLD.\r\n", price: 0, camping: " No", end_date: "2016-04-09"},
  {name: "Snowbombing 2016", latitude: 47.1681071, longitude: 11.861812200000031, start_date: "2016-04-04", date: "April 4-9, 2016", location: "Mayrhofen, Austria", website: "http://www.snowbombing.com/", description: "Nobody knows how to apres-ski like the Europeans which means Snowbombing is the ultimate on-the-hill music festival. The Austrian resort of Mayrhofen plays host to the madness of a full week of snowboarding, electronic music, and partying in the Alps. \r\n", price: 0, camping: " No", end_date: "2016-04-09"},
  {name: "Euphoria Festival 2016", latitude: 30.22734, longitude: -97.66120999999998, start_date: "2016-04-07", date: "April 7-10, 2016", location: "Austin, TX", website: "http://www.euphoriafest.com/#2015", description: "THE MULTI-STAGE FESTIVAL WITH CAMPING OPTIONS WILL BE HELD AT CARSON CREEK RANCH, ONE OF THE OLDEST EXISTING RANCHES IN TEXAS, CONSISTING OF TWO 20 ACRE PASTURES, SEPARATED BY CARSON CREEK ON THE BANKS OF THE COLORADO RIVER. CONVENIENTLY LOCATED JUST MINUTES FROM DOWNTOWN AUSTIN, THE GROUNDS PROVIDE A PICTURESQUE CAMPING SETTING WHILE STILL BEING CLOSE TO THE COMFORTS OF THE CITY. CONTINUING ITS PLEDGE TO PROVIDE THE CONCERTGOER WITH AN IMPROVED OVERALL FESTIVAL EXPERIENCE, EUPHORIA WILL BE BUILDING UPON PREVIOUS YEARS, INCLUDING CUTTING EDGE VISUALS, UNIQUE STAGE DESIGN, IMPROVED DANCE TENTS, ARTIST WORKSHOPS, FEATURING A DIVERSE RANGE OF ARTISTS, INTERACTIVE EXPERIENTIAL INSTALLATIONS AND SPECIAL LATE NIGHT SILENT DISCO SHOWS ON FRIDAY AND SATURDAY. ADDITIONALLY, THE FESTIVAL WILL EXPAND TO INCLUDE CAMPING OPTIONS, WHICH WILL PROVIDE CAMPERS WITH EARLY ACCESS TO THE VENUE, MORNING YOGA, MEDITATION, DAY CONCESSIONS, AND INCREASED VENUE FACILITIES.\r\n", price: 0, camping: " Yes", end_date: "2016-04-10"},
  {name: "Rhythm N Blooms 2016", latitude: 35.9606384, longitude: -83.92073920000001, start_date: "2016-04-08", date: "April 8-10, 2016", location: "Knoxville, TN", website: "http://www.rhythmnbloomsfest.com/", description: "Set amidst the urban artistic cityscape of the ever-growing Jackson Avenue in Knoxville, Tennessee from April 10-12, Rhythm N’ Blooms celebrates the crossroads of Knoxville’s varied musical history. This American Roots music festival spotlights storied songwriters and rich performances from jazz to world-class bluegrass to indie – and everything in between.\r\n", price: 0, camping: " No", end_date: "2016-04-10"},
  {name: "Caprices Festival 2016", latitude: 46.30762, longitude: 7.473709999999983, start_date: "2016-04-07", date: "April 7-10, 2016", location: "Crans-Montana, Switzerland", website: "http://www.caprices.ch/en/", description: "You know the drill. Ski and snowboard all day, then party all night with cutting-edge EDM artists from around the world. Okay, you might be partying all day as well in a transparent mountain-top tent that shows off the jaw-dropping Swiss Alps. Rest up before you go because sleep is not an option at Caprices\r\n", price: 0, camping: " No", end_date: "2016-04-10"},
  {name: "Mission Creek Festival 2016", latitude: 41.6611277, longitude: -91.53016830000001, start_date: "2016-04-05", date: "April 5-10, 2016", location: "Iowa City, IA", website: "http://www.missionfreak.com/", description: "MISSION CREEK FESTIVAL IS A WEEK-LONG EXPERIENCE THAT TAKES OVER THE VENUES AND SPACES OF DOWNTOWN IOWA CITYÂ€”CREATING AN EASILY NAVIGATED NEXUS OF MUSIC, LITERATURE, FOOD AND ART. AS WITH PAST FESTIVALS, THE UPCOMING EVENT WILL FEATURE A STRONG BALANCE OF NATIONAL, INTERNATIONAL AND REGIONAL MUSICIANS, WRITERS AND ARTISTS PERFORMING AND EXHIBITING THEIR WORK IN DOWNTOWN VENUES LIKE THE ENGLERT THEATRE, THE MILL, BLUE MOOSE TAP HOUSE, PUBLIC SPACE ONE, GABE'S, THE YACHT CLUB, PRAIRIE LIGHTS AND MANY OTHER TRADITIONAL AND NON-TRADITIONAL VENUES.\r\n", price: 0, camping: " No", end_date: "2016-04-10"},
  {name: "Wanee Music Festival 2016", latitude: 30.2949457, longitude: -82.98401999999999, start_date: "2016-04-14", date: "April 14-16, 2016", location: "Live Oak, FL", website: "http://www.waneefestival.com/", description: nil, price: 0, camping: " Yes", end_date: "2016-04-16"},
  {name: "Roadburn Festival 2016", latitude: 51.560596, longitude: 5.091914299999985, start_date: "2016-04-14", date: "April 14-17, 2016", location: "Tilburg, The Netherlands", website: "http://www.roadburn.com/", description: "Holland’s very own Roadburn Festival has become Europe’s leading underground festival for psychedelic, avant-garde, doom or any other variation of leftfield sonic pleasures that push the boundaries of music.\r\n", price: 0, camping: " Yes", end_date: "2016-04-17"},
  {name: "Tortuga Music Festival 2016", latitude: 26.1224386, longitude: -80.13731740000003, start_date: "2016-04-15", date: "April 15-17, 2016", location: "Fort Lauderdale, FL", website: "http://www.tortugamusicfestival.com/", description: "Held on the white sands of Fort Lauderdale Beach Park in a beautiful oceanside setting, Tortuga Music Festival is a multi-day, multi-stage music festival featuring some of the biggest names in country, rock and roots music.  Tortuga Music Festival brings like-minded fans together for an unforgettable beach weekend experience that pairs music with meaning to raise awareness for marine conservation.\r\n", price: 0, camping: " No", end_date: "2016-04-17"},
  {name: "Old Settler’s Music Festival 2016", latitude: 30.123275, longitude: -98.03158889999997, start_date: "2106-04-14", date: "April 14-17, 2106", location: "Driftwood, TX", website: "http://www.oldsettlersmusicfest.org/", description: "Old Settler's Music Festival is a nationally known music festival featuring the best in roots and Americana music. The festival is held in the gorgeous Texas hill country, at the height of the Bluebonnet and wildflower season. Old Settler's Music Festival offers great music and activities for the whole family.\r\n", price: 0, camping: " Yes", end_date: "2106-04-17"},
