  {name: "Coachella Music Festival 2016", latitude: 33.7205771, longitude: -116.21556190000001, start_date: "2016-04-15", date: "April 15-24, 2016", location: "Indio, CA", website: "http://www.coachella.com/", description: "Like a barometer always reading a temperature of awesome, the traditional kickoff to the summer festival season is dominated by Coachella. The glitz and glamour of Los Angeles migrates east to the Indio desert for back to back weekends of the biggest names in music. What started as a small electronic festival in the desert has transformed into a cultural touchstone for the festival season.\r\n", price: 0, camping: " Yes", end_date: "2016-04-24"},
  {name: "Some Kind of Jam 2016", latitude: 40.6306464, longitude: -76.17105400000003, start_date: "2016-04-22", date: "April 22-24, 2016", location: "Schuylkill Haven, PA", website: "http://www.jibberjazz.com/", description: "Festival takes place on beautiful 60-acre rustic fairground, featuring outdoor & indoor stages, plenty of camping space, permanent restrooms & showers, nature trails, trout fishing waters, and electricity access for RV's. A vast array of both food and craft vendors will be on-site for the weekend. Additionally, a full slate of festival activities is scheduled for both adults and children.\r\n", price: nil, camping: " Yes", end_date: "2016-04-24"},
  {name: "SweetWater 420 Festival 2016", latitude: 33.7666145, longitude: -84.39192220000001, start_date: "2016-04-22", date: "April 22-24, 2016", location: "Atlanta, GA", website: "http://www.sweetwater420fest.com/", description: "AN ANNUAL FESTIVAL SPONSORED BY SWEETWATER BREWING COMPANY IN THE HEART OF ATLANTA AT CENTENNIAL OLYMPIC PARK.THREE DAYS OF ENVIRONMENTAL AWARENESS, AWESOME BANDS FROM ALL AROUND THE COUNTRY, SWEETWATER'S HEADY BREWS, KILLER PEOPLE, TONS OF VENDORS AND DELICIOUS FOOD.\r\n", price: 0, camping: " No", end_date: "2016-04-24"},
  {name: "Vive Latino 2016", latitude: 19.4326077, longitude: -99.13320799999997, start_date: "2016-04-23", date: "April 23-24, 2016", location: "Mexico City, Mexico", website: "http://www.vivelatino.com.mx/", description: "THE LATIN AMERICAN MUSIC CULTURE FESTIVAL VIVE LATINO(VIVE LATINO, EL VIVE) IS A ROCK AND VARIOUS ALTERNATIVE MUSIC GENRES FESTIVAL HELD ANNUALLY SINCE 1998 (EXCEPT 1999 AND 2002), AT FORO SOL, MEXICO CITY, ORGANIZED BY OCESA.\r\n", price: 0, camping: " No", end_date: "2016-04-24"},
  {name: "Groezrock 2016", latitude: 51.13218999999999, longitude: 5.077080000000024, start_date: "2016-04-29", date: "April 29-30, 2016", location: "Meerhout, Belgium", website: "http://www.groezrock.be/", description: "GROEZROCK, by tradition the festival opener in Belgium, offers the best punkrock, hardcore, rock, emorock, scream(emo), ska, or simply exceptional music of today and tomorrow. GROEZROCK has become one of the largest punkrocking festivals in Europe. \r\n", price: 0, camping: " Yes", end_date: "2016-04-30"},
