  {name: "M3 Rock Festival 2016", latitude: 39.2089501, longitude: -76.8626726, start_date: "2016-04-29", date: "April 29- 30, 2016", location: "Columbia, MD", website: "http://m3rock.webs.com/", description: nil, price: nil, camping: " No", end_date: "2016-04-30"},
  {name: "Live at Leeds 2016", latitude: 53.8007554, longitude: -1.5490773999999874, start_date: "2016-04-30", date: "April 30, 2016", location: "Leeds, UK", website: "http://www.liveatleeds.com/", description: "LIVE AT LEEDS IS A METROPOLITAN MUSIC FESTIVAL HELD ANNUALLY ACROSS A VARIETY OF VENUES IN LEEDS ON THE FIRST BANK HOLIDAY WEEKEND OF MAY. THE ETHOS HAS ALWAYS BEEN TO CELEBRATE THE BEST IN UPCOMING LOCAL TALENT ALONGSIDE MORE ESTABLISHED NATIONAL AND INTERNATIONAL ARTISTS.\r\n", price: 0, camping: " No", end_date: "2016-04-30"},
  {name: "Further Future 2016", latitude: 36.1699412, longitude: -115.13982959999998, start_date: "2016-04-29", date: "April 29- May 1, 2016", location: "Las Vegas, NV", website: "http://www.furtherfuture.com/", description: "Further Future was founded by the crew that created Robot Heart, a pioneering, cultural force within the electronic music community. Moving beyond the confines of a traditional music festival, Further Future seeks to bring together world-class musicians and artists, alongside inspiring thought leaders in the areas of science, entrepreneurship, innovation, and technology with a goal of creating a community of like minded individuals open to cultural exploration and change.\r\n", price: nil, camping: " Yes", end_date: "2016-05-01"},
  {name: "Beale Street Music Festival 2016", latitude: 35.136011, longitude: -90.06374700000003, start_date: "2016-04-29", date: "April 29-May 1, 2016", location: "Memphis, TN", website: "http://memphisinmay.org/musicfestival", description: "EACH YEAR BEALE STREET MUSIC FESTIVAL ATTRACTS MUSIC ENTHUSIASTS FROM ALL 50 STATES AND A DOZEN FOREIGN COUNTRIES TO THE STORIED CITY WHERE ROCK-N-ROLL AND BLUES MUSIC ALL BEGAN. OVER THE PAST DECADE THE FESTIVAL HAS ATTRACTED OVER 1.1 MILLION MUSIC FANS TO THE MULTISTAGE THREE-DAY EVENT, BEST KNOWN FOR ITS ECLECTIC MIX OF CONTEMPORARY ROCK, BLUES, SOUL AND MODERN TALENT AND ITS MUSICALLY INSPIRED SETTING. THE FESTIVAL IS HELD IN A BEAUTIFUL 25 ACRE RIVERFRONT PARK AT THE FOOT OF HISTORIC BEALE STREET OVERLOOKING THE MIGHTY MISSISSIPPI RIVER.\r\n", price: 0, camping: " No", end_date: "2016-05-01"},
  {name: "New Orleans Jazz Festival 2016", latitude: 29.95106579999999, longitude: -90.0715323, start_date: "2016-04-22", date: "April 22-May 1, 2016", location: "New Orleans, LA", website: "http://www.nojazzfest.com/", description: "WITH TWELVE STAGES OF VIRTUALLY EVERY STYLE OF ROOTS MUSIC, JAZZ FEST PRESENTS ONE OF THE ENTERTAINMENT WORLD'S MOST DIVERSE MUSIC LINEUPS, INCLUDING ITS UNPARALLELED SHOWCASE OF LOUISIANA'S UNIQUE CULTURE.\r\n", price: 0, camping: " No", end_date: "2016-05-01"},
  {name: "Stagecoach Music Festival 2016", latitude: 33.70229929239078, longitude: -116.29246619687501, start_date: "2016-04-29", date: "April 29-May 1, 2016", location: "Indio, CA", website: "http://www.stagecoachfestival.com/", description: nil, price: nil, camping: " Yes", end_date: "2016-05-01"},
  {name: "Bristol Folk Festival 2016", latitude: 51.4538242, longitude: -2.6032069999999976, start_date: "2016-04-30", date: "April 30-May 1, 2016", location: "Bristol, UK", website: "http://bristolfolkfestival.co.uk/", description: nil, price: nil, camping: " No", end_date: "2016-05-01"},
  {name: "Levitation 2016", latitude: 30.22734, longitude: -97.66120999999998, start_date: "2016-04-29", date: "April 29-May 1, 2016", location: "Austin, TX", website: "http://www.austinpsychfest.com/", description: "Levitation, formally Austin Psych Fest was founded in 2008. Over the years, this independent festival has grown from a small word-of-mouth event to an internationally acclaimed, full weekend event that attracts attendees from all over the world. We are humbled and honored each year to host many of our favorite artists and an amazing community of music lovers from all over. \r\n", price: 0, camping: " Yes", end_date: "2016-05-01"},
  {name: "Welcome to Rockville 2016", latitude: 30.3321838, longitude: -81.65565099999998, start_date: "2016-04-30", date: "April 30-May 1, 2016", location: "Jacksonville, FL", website: "http://www.welcometorockvillefestival.com/", description: nil, price: 0, camping: " No", end_date: "2016-05-01"},
  {name: "MerleFest 2016", latitude: 36.1459649, longitude: -81.16064010000002, start_date: "2016-04-28", date: "April 28- May 1, 2016", location: "Wilkesboro, NC", website: "http://merlefest.org/", description: "MERLEFEST, CONSIDERED ONE OF THE PREMIER MUSIC FESTIVALS IN THE COUNTRY, IS AN ANNUAL HOMECOMING OF MUSICIANS AND MUSIC FANS HELD ON THE CAMPUS OF WILKES COMMUNITY COLLEGE IN WILKESBORO, NORTH CAROLINA.\r\n", price: 0, camping: " No", end_date: "2016-05-01"},
  {name: "Moonstone 2016", latitude: 28.5383355, longitude: -81.37923649999999, start_date: "2016-04-30", date: "April 30- May 1, 2016", location: "Orlando, FL", website: "http://www.moonstonemusicfestival.com/", description: nil, price: 0, camping: " No", end_date: "2016-05-01"},
  {name: "Sunfest 2016", latitude: 26.7153424, longitude: -80.05337459999998, start_date: "2016-04-27", date: "April 27-May 1, 2016", location: "West Palm Beach, FL", website: "http://www.sunfest.com/", description: "Founded in 1982, SunFest is Florida’s largest waterfront music and art festival. Held annually in downtown West Palm Beach, Florida the first week in May, SunFest attracts more than 175,000 visitors. The festival and the patrons have a positive impact on the local economy.\r\n", price: 0, camping: " No", end_date: "2016-05-01"},
