  {name: "Estrella Levante SOS 4.8 2016", latitude: 38.1398141, longitude: -1.3662160000000085, start_date: "2016-05-06", date: "May 6-7, 2016", location: "Murcia, Spain", website: "http://www.sos48.com/", description: nil, price: 0, camping: " Yes", end_date: "2016-05-07"},
  {name: "Groovin’ The Moo 2016", latitude: 0.0, longitude: 0.0, start_date: "2016-04-23", date: "April 23-May 7, 2016", location: "Australia Tour", website: "http://www.gtm.net.au/", description: nil, price: 0, camping: " No", end_date: "2016-05-07"},
  {name: "Carolina Rebellion 2016", latitude: 35.35966430000001, longitude: -80.69300550000003, start_date: "2016-05-06", date: "May 6-8, 2016", location: "Concord, NC", website: "http://www.carolinarebellion.com/", description: nil, price: 0, camping: " Yes", end_date: "2016-05-08"},
  {name: "Nuits Sonores 2016", latitude: 45.764043, longitude: 4.835658999999964, start_date: "2016-05-04", date: "May 4-8, 2016", location: "Lyon, France", website: "http://www.nuits-sonores.com/en/", description: "Nuits Sonores is a French festival entirely dedicated to electronic, independent, visual and digital cultures where music, design, graphic arts and architecture are intimately connected. Each year, the festival transforms about 40 locations across the city.  Since the festival’s beginnings, over 250 locations in Lyon have been used and redesigned including art galleries, industrial wastelands, rooftops and even swimming pools. This has always encouraged the public to explore and discover the festival by foot, bike or using public transport. Nuits Sonores aims to decode past, present and future innovative cultures. This unique and curious mind-set brings together headliners and rising talent, popular music and niche music from local, national and international scenes.\r\n", price: 82, camping: " No", end_date: "2016-05-08"},
  {name: "Dreamscape 2016", latitude: 39.6469591, longitude: -76.17034660000002, start_date: "2016-05-05", date: "May 5-8, 2016", location: "Darlington, MD", website: "http://dreamscapefestival.com/", description: nil, price: 0, camping: " Yes", end_date: "2016-05-08"},
  {name: "Canadian Music Week 2016", latitude: 43.653226, longitude: -79.38318429999998, start_date: "2016-05-04", date: "May 4-14. 2016", location: "Toronto, ON", website: "http://cmw.net/music/#", description: "The largest music festival in Canada boasts 900 bands in over 60 venues for five nights of music. With a wristband running well under $100, CMF is your best bet of the year for the most music for the least amount of cash. Plan ahead — this is one of those festivals that you’ll need a schedule to see everything.\r\n", price: 0, camping: " No", end_date: "2016-05-14"},
