  {name: "Joshua Tree Spring 2016", latitude: 34.2058757, longitude: -116.24689569999998, start_date: "2016-05-12", date: "May 12-15, 2016", location: "Joshua Tree, CA", website: "http://joshuatreemusicfestival.com/", description: "These independently produced music festivals are held annually in the shadows of the infamous National Park. They are two (of the very few) multi-day campout music festivals in Southern California featuring live music. Music lovers of all ages enjoy this phenomenal live music in an intimate setting and magical surroundings. The spring festival features an eclectic line up of performers; dance-world-electro-funk'n groove. The fall fest differs musically with artists of the more rootsicana-newgrassy-folkadelic realms. The two different musical stylings create distinct audiences at the festivals, but many folks do attend both. The town of Joshua Tree is located in the high desert of the magical Mojave, 50 minutes from Palm Springs, 2.5 hour drive from LA, 3 from San Diego, 3.5 from Vegas, and 5 from Phoenix, at the entrance to the world renowned national park. \r\n", price: 0, camping: " Yes", end_date: "2016-05-15"},
  {name: "Pfingst Open Air 2016", latitude: 48.8777333, longitude: 12.580153800000062, start_date: "2016-05-12", date: "May 12-15, 2016", location: "Straubing, Germany", website: "http://www.pfingstopenair.de/", description: "For more than 30 years the Pfingst-Open-Air (POA) is one of the dinosaurs in the German Festival-Landscape! Due to its vast variety of music styles somewhere located between rock, hiphop, electronic, ska and many more the visitors form a colourful, wild, crazy, happy bunch which can not be categorised! The festival is always up for innovative music styles and upcoming artists and is located in the beautiful region of Bavaria close to Straubing.\r\n", price: nil, camping: " Yes", end_date: "2016-05-15"},
