  {name: "The Great Escape 2016", latitude: 50.82253000000001, longitude: -0.13716299999998682, start_date: "2016-05-19", date: "May 19-21, 2016", location: "Brighton, UK", website: "http://greatescapefestival.com/", description: "Since being founded in 2006, The Great Escape has been firmly established internationally as the leading event for showcasing new music. Taking place in Brighton over 3 days in May, The Great Escape kicks starts the festival season, introducing 15,000 music lovers to the key artists and sounds of the year. Over 300 bands playing in 30 venues over 3 days, pre-publicized performances, and impromptu street gigs spring up all over town. The Alternative Escape, numerous club nights, label parties, industry showcases, unique collaborations and outdoor gigs all add to the festivities.\r\n", price: 0, camping: " No", end_date: "2016-05-21"},
  {name: "Moogfest 2016", latitude: 35.9940329, longitude: -78.898619, start_date: "2016-05-19", date: "May 19-22, 2016", location: "Durham, NC", website: "http://www.moogfest.com/", description: "Moogfest is the synthesis of music, art and technology - a conference for creative / technology  professionals with evenings of electronic music.\r\n", price: 0, camping: " No", end_date: "2016-05-22"},
  {name: "Hangout Festival 2016", latitude: 30.2460361, longitude: -87.70081929999998, start_date: "2016-05-20", date: "May 20-22, 2016", location: "Gulf Shores, AL", website: "http://hangoutmusicfest.com/", description: "The Hangout Festival is the first and only music festival of it's kind in North America. Located directly on the white sandy beaches of Gulf Shores, AL. The festival treats guests to a unique festival experi- ence and consistently features a diverse selection of top tour- ing artists.\r\n", price: 0, camping: " No", end_date: "2016-05-22"},
  {name: "Rock on the Range 2016", latitude: 40.045981, longitude: -82.85169300000001, start_date: "2016-05-20", date: "May 20-22, 2016", location: "Columbus, OH", website: "http://www.rockontherange.com/", description: "The multi-stage music and lifestyle event features a potent lineup of bands on three stages over three days. The nationally renowned festival that’s centrally located in the heart of the country is proud to be part of the World’s Loudest Month festival series, and annually draws huge weekend crowds since its inception in 2007, including a sold-out crowd of over 120,000 fans in 2014.\r\n", price: 0, camping: " Yes", end_date: "2016-05-22"},
