  {name: "Pouzza Fest 2016", latitude: 45.5016889, longitude: -73.56725599999999, start_date: "2016-05-20", date: "May 20-22, 2016", location: "Montreal, QC", website: "http://pouzzafest.com/index.php?p=1/", description: "POUZZA FEST IS A PUNK ROCK MUSIC FESTIVAL SET TO TAKE PLACE IN DOWNTOWN MONTREAL. OVER 200 BANDS WILL PERFORM IN 9 DIFFERENT VENUES ALL WITHIN WALKING DISTANCE FROM EACH OTHER. POUZZA FEST'S GOAL IS TO SHOWCASE THE SENSE OF COMMUNITY WHICH HAS BEEN AT THE CORE OF THE PUNK ROCK SCENE FROM ITS VERY START. WE WISH FOR THIS EVENT TO BE A HUGE PARTY FOR EVERYONE INVOLVED. WE WANT EVERY ATTENDEE TO BE ABLE TO SEE THEIR FAVORITE BANDS, TO DISCOVER NEW ONES, TO MEET NEW FRIENDS AND TO EXPERIENCE AN ALL-AROUND UNIQUE WEEKEND IN THE WONDERFUL SETTING THAT IS MONTREAL.\r\n", price: 0, camping: " No", end_date: "2016-05-22"},
