  {name: "Bottlerock 2016", latitude: 38.2975381, longitude: -122.28686500000003, start_date: "2016-05-27", date: "May 27-29, 2016", location: "Napa, CA", website: "http://www.bottlerocknapavalley.com/", description: "LIKE A FINE WINE, BOTTLEROCK KEEPS GETTING BETTER WITH AGE. THE THREE-DAY FESTIVAL IN CALIFORNIA'S STUNNING NAPA VALLEY FEATURES HUGE BANDS, INDIE ACTS, AMAZING FOOD, AND OF COURSE, LOTS OF THE REGION'S WINE.\r\n", price: 0, camping: " No", end_date: "2016-05-29"},
  {name: "Bearded Theory Festival 2016", latitude: 53.122322, longitude: -1.5136820999999827, start_date: "2016-05-26", date: "May 26-29. 2016", location: "Derbyshire, UK", website: "http://www.beardedtheory.co.uk/", description: "The record breaking party with Beards, Bands, Arts, Crafts, Weddings, DJs and General Daftness, is a three day music festival that has now firmly entrenched itself as being the first \"proper\" festival of the season. Every year Bearded Theory attempts to break the world record for the most amount of people wearing a fancy dress beards in one place and at one time. We want to live up to our bizarre name and invite everyone that attends to take part BUT its not compulsory. \r\n", price: 0, camping: " Yes", end_date: "2016-05-29"},
  {name: "Boston Calling 2016", latitude: 42.3584308, longitude: -71.0597732, start_date: "2016-05-27", date: "May 27-29, 2016", location: "Boston, MA", website: "http://bostoncalling.com/", description: "It’s been a dry spell for Boston and music festivals until Boston Calling showed up with this festival held in City Hall Plaza. As if making up for lost time, Boston Calling now happens twice a year. The spring version takes place over Memorial Day Weekend and has featured acts like Death Cab for Cutie, The National, Bastille, and Built to Spill. \r\n", price: 0, camping: " No", end_date: "2016-05-29"},
  {name: "Maryland Deathfest 2016", latitude: 39.2903848, longitude: -76.61218930000001, start_date: "2016-05-26", date: "May 26-29, 2016", location: "Baltimore, MD", website: "http://www.marylanddeathfest.com/", description: "The concept of MDF is simple: to bring to the United States the best and most extreme bands the underground has to offer. Never conforming to trends, or being limited by genre restrictions, MDF is a showcase of what extreme music, both new and old, is capable of. \r\n", price: 0, camping: " No", end_date: "2016-05-29"},
  {name: "Rocklahoma 2016", latitude: 36.3084275, longitude: -95.31691360000002, start_date: "2016-05-27", date: "May 27-29, 2016", location: "Pryor, OK", website: "http://www.rocklahoma.com/", description: "Looking for a contemplative weekend of drum circles and mellow campfire jams -- then Rocklahoma is your nightmare. The only thing more legendary than the lineup at Rocklahoma are the campground ragers. Contests throughout the weekend inspire party animals to fully trick out their campsite in creative and often, puzzling ways. --MFJ\r\n", price: 0, camping: " Yes", end_date: "2016-05-29"},
  {name: "River City Rockfest 2016", latitude: 29.4330386, longitude: -98.43379870000001, start_date: "2016-05-29", date: "May 29, 2016", location: "San Antonio, TX", website: "http://rivercityrockfest.com/", description: nil, price: nil, camping: " No", end_date: "2016-05-29"},
  {name: "Summer Camp 2016", latitude: 40.9222589, longitude: -89.48620249999999, start_date: "2016-05-27", date: "May 27-29, 2016", location: "Chillicothe, IL", website: "http://summercampfestival.com/", description: "From chilled out late night campfire jams to beat busting dance shows, the party at Summer Camp goes long past the end of scheduled performances. “Scampers” can apply to become camp counselors which means free tickets, free camping, and free beer in exchange for being an official party ambassador to the other attendees. Our resident festival expert calls Summer Camp — “The best festival of the Memorial Day Weekend.”\r\n", price: 0, camping: " Yes", end_date: "2016-05-29"},
  {name: "DelFest 2016", latitude: 39.6528654, longitude: -78.7625185, start_date: "2016-05-26", date: "May 26-29, 2016", location: "Cumberland, MD", website: "http://delfest.com/", description: "The legendary bluegrass artist Del McCoury curates this annual festival at the picture perfect Allegany County Fairgrounds in Maryland. Camping, dancing, and of course, plenty of bluegrass set the stage for a Memorial Day Weekend of world class collaborations, special guest sit-ins, informal workshops, and late night picking sessions. \r\n", price: 0, camping: " Yes", end_date: "2016-05-29"},
  {name: "Sound City 2016", latitude: 53.4083714, longitude: -2.9915726000000404, start_date: "2016-05-28", date: "May 28-29, 2016", location: "Liverpool, UK", website: "http://www.liverpoolsoundcity.co.uk/", description: "Liverpool Sound City is the largest international music, digital and film festival and conference in the UK, welcoming over 360 artists, in over 25 venues in Liverpool's city centre, with over 40,000 music fans and over 3000 industry professionals. Every year we take pride in bringing some of the most exciting breakthrough artists to the festival, giving the city an opportunity to see tomorrows major acts up close and personal, before anyone else.\r\n", price: 0, camping: " No", end_date: "2016-05-29"},
