  {name: "California Roots 2016", latitude: 36.6002378, longitude: -121.89467609999997, start_date: "2016-05-27", date: "May 27-29, 2016", location: "Monterey, CA", website: "http://californiarootsfestival.com/", description: "California Roots isn’t just a music festival; it’s a movement. It’s a way of life. It delivers a cosmic blend of good vibes, true happiness, family, peace, love and joy to all who enter. When Jimi Hendrix torched his guitar at the Monterey Pop Festival in the late ‘60’s, he changed the way an entire generation looked not only at music festivals, but life itself.\r\n", price: 0, camping: " No", end_date: "2016-05-29"},
