  {name: "Sasquatch 2016", latitude: 47.10139, longitude: -119.99571100000003, start_date: "2016-05-27", date: "May 27-30, 2016", location: "George, WA", website: "http://www.sasquatchfestival.com/", description: "Much like its namesake, the Sasqutach festival resides in the northwest, is completely legendary, and sought after by fans from all over the world. The Memorial Weekend powerhouse now stretches over four days in a trippy Washington wasteland that would be considered desolate if The Gorge didn’t provide one of the greatest natural stages known to man.\r\n", price: 0, camping: " Yes", end_date: "2016-05-30"},
  {name: "Movement 2016", latitude: 42.331427, longitude: -83.0457538, start_date: "2016-05-28", date: "May 28-30, 2016", location: "Detroit, MI", website: "http://www.movement.us/", description: "Long before the onslaught of the modern day EDM festival scene, the Movement Festival has owned downtown Detroit over Memorial Day Weekend. Running under a few different names since 2000, this festival brings in top talent to Hart Plaza and delivers an EDM urban experience far different than any other you’ll find over the summer. \r\n", price: 0, camping: " No", end_date: "2016-05-30"},
  {name: "Lightning in a Bottle 2016", latitude: 35.8632993, longitude: -120.8007321, start_date: "2016-05-25", date: "May 25-30, 2016", location: "Bradley, CA", website: "http://lightninginabottle.org/", description: "The dedicated fans of this transformational festival have kept LiB at the top of its game for over ten years. It’s changed venues more than a few times but the incredible art, enthusiastic attendees, and top notch lineup at this boutique fest is a steady constant.  \r\n", price: 0, camping: " Yes", end_date: "2016-05-30"},
  {name: "Punk Rock Bowling Las Vegas 2016", latitude: 36.1699412, longitude: -115.13982959999998, start_date: "2016-05-28", date: "May 28-30, 2016", location: "Las Vegas, NV", website: "https://punkrockbowling.com/", description: "Punk Rock Bowling & Music Festival was started back in 1999 by brothers Shawn and Mark Stern, owners of the long standing independent record label BYO Records, as a way to bring the independent music community together for an annual party. It has since grown into a 5-day festival in downtown Las Vegas that brings out fans and bands alike from all over the world. 3 days of outdoor festivals, 5 Nights of Club Shows, a 2-day bowling tournament, Hotel Pool Parties, a Punk Rock Poker tournament, movie screenings and comedy shows to boot, all wrapped up into one amazing weekend in the city that never sleeps. And now, we welcome our fans, friends and family to our first trip east, to Asbury Park as well, in 2016.\r\n", price: 0, camping: " No", end_date: "2016-05-30"},
