  {name: "Field Trip 2016", latitude: 43.639276, longitude: -79.403029, start_date: "2016-06-04", date: "June 4-5, 2016", location: "Toronto, ON", website: "http://fieldtriplife.com/", description: "FIELD TRIP BEGAN IN 2013 AS A CELEBRATION OF ARTS & CRAFTS' 10TH ANNIVERSARY, BUT IN OUR SECOND YEAR OUR SIGHTS ARE SQUARELY ON ESTABLISHING IT AS A WORLD-CLASS, TWO-DAY BOUTIQUE MUSIC AND ARTS FESTIVAL SITUATED IN THE HEART OF DOWNTOWN TORONTO. THE 2014 EDITION WILL UNFOLD ACROSS TWO DAYS, PROGRAMMED FAR BEYOND MUSIC TO FOCUS ON HIGHLIGHTING THE COMMUNITY'S BEST CULINARY OFFERINGS, AS WELL AS COLLABORATIVE EXPLORATIONS ON THE THEMES OF ART, PHOTOGRAPHY, TECHNOLOGY, FASHION AND MORE.\r\n", price: 0, camping: " No", end_date: "2016-06-05"},
  {name: "Free Press Summer Fest 2016", latitude: 29.761644, longitude: -95.37759699999998, start_date: "2016-06-04", date: "June 4-5, 2016", location: "Houston, TX", website: "http://fpsf.com/", description: "FREE PRESS SUMMER FEST IS HELD AT HOUSTON'S ELEANOR TINSLEY PARK, LOCATED WITHIN THE BEAUTIFUL ROLLING HILLS OF THE GREATER BUFFALO BAYOU PARK. SITUATED ON THE VERY OUTSKIRTS OF DOWNTOWN, TINSLEY PARK MARRIES THE VERY BEST OF CITY AND NATURAL SETTINGS WITH ITS NATURAL GRASS AMPHITHEATER SET ON THE BAYOU OVERLOOKING HOUSTON'S IMPRESSIVE SKYLINE.\r\n", price: 0, camping: " No", end_date: "2016-06-05"},
