  {name: "Taste of Country 2016", latitude: 42.1778661, longitude: -74.2304216, start_date: "2016-06-10", date: "June 10-12, 2016", location: "Hunter Mountain, NY", website: "http://tasteofcountryfestival.com/", description: "THE TASTE OF COUNTRY MUSIC FESTIVAL IS THE FIRST AND ONLY 3-DAY COUNTRY MUSIC CAMPING FESTIVAL IN THE NORTHEAST. THE FESTIVAL FEATURES WORLD CLASS ENTERTAINMENT, CAMPING IN THE RENOWNED TERRAIN OF THE GREAT NORTHERN CATSKILLS OF GREENE COUNTY, OUTDOOR RECREATION, TOP-NOTCH FOOD AND BEVERAGE SERVICE AND LUXURY MOUNTAINSIDE ACCOMMODATIONS UNIQUE TO HOST HUNTER MOUNTAIN. THE FESTIVAL HAS ALREADY ESTABLISHED ITSELF AS A MUST-DO FOR COUNTRY MUSIC FANS BECAUSE OF THE POWERHOUSE LIST OF ARTISTS THAT PERFORM.\r\n", price: 0, camping: " Yes", end_date: "2016-06-12"},
