  {name: "Pinkpop 2016", latitude: 50.89276460000001, longitude: 6.022408499999983, start_date: "2016-06-10", date: "June 10-12, 2016", location: "Landgraaf, The Netherlands", website: "http://www.pinkpop.nl/2014/", description: "The Netherland's most famous open-air festival and Europe's longest-running uninterrupted outdoor pop festival PINKPOP will take place in the city of Landgraaf, at the beautiful festival site MEGALAND, 134 miles south of Amsterdam. There are 4 large campsites, providing space for 50.000 campers. In 40 years the festival has sold out 20 times, with a capacity of 60.000 attendees per day. Since 1970 more than 1,8 million people have visited the festival and more than 500 acts have performed on stage.\r\n", price: nil, camping: " Yes", end_date: "2016-06-12"},
  {name: "Carolina Country Music Festival 2016", latitude: 33.6890603, longitude: -78.88669429999999, start_date: "2016-06-10", date: "June 10-12, 2016", location: "Myrtle Beach, SC", website: "http://www.carolinacountrymusicfest.com/", description: "Grab a cowboy hat and a pair of flip-flops, as country music meets the scenic shores of Myrtle Beach when the boardwalk becomes home to the Carolina Country Music Fest (CCMF), June 5-7! \r\n", price: 0, camping: " No", end_date: "2016-06-12"},
  {name: "Punk Rock Bowling NJ 2016", latitude: 40.2203907, longitude: -74.01208170000001, start_date: "2016-06-11", date: "June 11-12, 2016", location: "Asbury Park, NJ", website: "https://punkrockbowling.com/", description: "Punk Rock Bowling & Music Festival was started back in 1999 by brothers Shawn and Mark Stern, owners of the long standing independent record label BYO Records, as a way to bring the independent music community together for an annual party. It has since grown into a 5-day festival in downtown Las Vegas that brings out fans and bands alike from all over the world. 3 days of outdoor festivals, 5 Nights of Club Shows, a 2-day bowling tournament, Hotel Pool Parties, a Punk Rock Poker tournament, movie screenings and comedy shows to boot, all wrapped up into one amazing weekend in the city that never sleeps. And now, we welcome our fans, friends and family to our first trip east, to Asbury Park as well, in 2016.\r\n", price: 0, camping: " No", end_date: "2016-06-12"},
