  {name: "Northside Festival Brooklyn 2016", latitude: 40.6781784, longitude: -73.9441579, start_date: "2016-06-06", date: "June 6-12, 2016", location: "Brooklyn, NY", website: "http://www.northsidefestival.com/", description: "North Brooklyn is transformed into an urban festival unlike anything you’ve ever experienced. As opposed to a traditional festival or conference where events take place in one or two locations, Northside Festival spans all of Williamsburg and Greenpoint, encompassing a constellation of venues – small clubs, epic outdoor spaces like McCarren Park, boutique hotels, local movie theatres and more. Northside Festival is where culture and innovation intersect. A single day might include discovering your new favorite artist, the next big startup or the most inspiring digital content you’ve seen all year.\r\n", price: 0, camping: " No", end_date: "2016-06-12"},
  {name: "Bestival Toronto 2016", latitude: 43.6669549, longitude: -79.31183379999999, start_date: "2016-06-11", date: "June 11-12, 2016", location: "Toronto, ON", website: "http://bestival.ca/", description: "Featuring Bestival friends old and new, and a healthy dose of kick-ass acts from the UK, Canada and worldwide, nurturing the freshest, new, local talent, and showcasing some world famous showstoppers, it’s a statement of intent; and that intent is to party all weekend long! So much more than just a music festival, Bestival will be a creative wonderland set upon the iconic and picturesque Hanlan’s Point Beach, Toronto Island\r\n", price: nil, camping: " No", end_date: "2016-06-12"},
  {name: "Mysteryland USA 2016", latitude: 41.696967, longitude: -74.87761499999999, start_date: "2016-06-10", date: "June 10-13, 2016", location: "Bethel, NY", website: "http://www.mysteryland.us/en/", description: "Like sailors in the days of old, the long-running Mysteryland out of The Netherlands set sail for the far shores of America. Making landfall in upstate New York at the iconic Woodstock ’69 venue, this Memorial Day fest looks like it’s here to stay and we couldn’t be happier. A stacked EDM lineup keeps this festival going all night with everything from international headliners to underground dance music.\r\n", price: 0, camping: " Yes", end_date: "2016-06-13"},
