  {name: "Essence Music Festival 2016", latitude: 29.95106579999999, longitude: -90.0715323, start_date: "2016-06-30", date: "June 30- July 3, 2016", location: "New Orleans, LA", website: "http://www.essence.com/festival", description: "THE PREMIERE MUSIC & CULTURAL FESTIVAL - SUMMER NEW ORLEANS. THE ESSENCE MUSIC FESTIVAL IS THE LARGEST STATESIDE GATHERING OF AFRICAN-AMERICANS IN THE UNITED STATES. IT'S WHERE WE ALL COME TOGETHER TO CELEBRATE ENTERTAINMENT AND CULTURE LIKE NO OTHER FESTIVAL IN THE WORLD. EACH YEAR, OVER 400,000 PEOPLE JOINED US IN NEW ORLEANS, WHERE WE'VE BEEN SINCE 1993.\r\n", price: 0, camping: " No", end_date: "2016-07-03"},
