  {name: "Great Blue Heron Festival 2016", latitude: 42.1592235, longitude: -79.59532580000001, start_date: "2016-07-01", date: "July 1-3, 2016", location: "Sherman, NY", website: "http://www.greatblueheron.com/", description: "The Great Blue Heron Music Festival delivers an eclectic musical lineup that delights music lovers of all ages. GBH is hosted on an organic farm in rural Western New York State that offers clean air, clean water and lots of woodlands, pastures & shade. A community of 7000 friendly people saying \"Happy Heron” comes together annually to celebrate life, to enjoy music & to dance! Three days and nights are filled with national and regional acts on three stages highlighting Americana roots, rock, reggae, zydeco, swing, old time, hip-hop, celtic and bluegrass styles. Families will enjoy our Kids’ Tent, Teen Tent and Instrument and Healing Arts workshops and Fire Circle. The Blue Heron has been a homecoming for many since it's beginnings in 1992. GBH is completely patron-sponsored, no corporate hype anywhere to be found at this gathering.   Patrons can camp overnight all weekend or visit just for the day.\r\n", price: 0, camping: " Yes", end_date: "2016-07-03"},
