  {name: "OpenAir St. Gallen 2016", latitude: 47.4179284, longitude: 9.364396800000009, start_date: "2016-06-30", date: "June 30-July 3, 2016", location: "St. Gallen, Switzerland", website: "http://www.openairsg.ch/", description: "The OpenAir St.Gallen is one of the oldest outdoor festivals in Switzerland. It's close to the city and it's the second biggest festival in the German part of the country (30,000 capacity per day). The camping site is included in the festival area and no boundaries between sleeping and going to the shows. If you're lucky you'll be able to see your favorite band perform on stage while you're relaxing in front of your tent. This is something that makes the OpenAir St.Gallen very special, besides the unique setting in the valley of the river Sitter surrounded by trees.\r\n", price: 0, camping: " Yes", end_date: "2016-07-03"},
