  {name: "Bilbao BBK Live 2016", latitude: 43.2630126, longitude: -2.9349852000000283, start_date: "2016-07-07", date: "July 7-9, 2016", location: "Bilbao, Spain", website: "http://bilbaobbklive.com/", description: "BILBAO BBK LIVE IS A THREE-DAY MUSIC FESTIVAL THAT TAKES PLACE ON TOP OF A HILL SURROUNDED BY MOUNTAINS OFFERING SPECTACULAR VIEWS OVER THE CITY OF BILBAO. THE PRIVILEGED LOCATION OF THE SITE, ITS PROXIMITY TO THE CITY AND BEACH AND A LATE START OF BANDS, ALLOW YOU TO MAKE THE MOST OF THIS EVENT AND UNIQUE SETTING. BILBAO IS A MODERN CITY FAMOUS FOR ITS ARCHITECTURE, MUSEUMS AND GASTRONOMY, AND IT'S JUST A STONE'S THROW AWAY FROM SOME OF THE BEST WAVES IN EUROPE! BILBAO BBK LIVE IS ABOVE ALL A FUSS FREE FESTIVAL; WITH AN UNCOMPLICATED LAYOUT, EASY ACCESS FROM THE CITY AND AIRPORT IT HAS PROVEN TO BE A HUGE SUCCESS WITH NATIONAL AND INTERNATIONAL FESTIVAL GOERS.\r\n", price: 0, camping: " Yes", end_date: "2016-07-09"},
  {name: "2000trees 2016", latitude: 51.842814, longitude: -1.9696309999999357, start_date: "2016-07-07", date: "July 7-9, 2016", location: "Gloucestershire, UK", website: "http://www.twothousandtreesfestival.co.uk/", description: "2000trees is all about New & Underground Music. There are no genre distinctions (although most of the bands do tend to hold guitars), just guaranteed great music in the beautiful Cotswolds.  In no particular order, you'll also get an amazingly friendly atmosphere, the highest quality food traders possible and locally handcrafted ales, lagers & ciders.\r\n", price: 0, camping: " Yes", end_date: "2016-07-09"},
  {name: "80/35 Music Festival 2016", latitude: 41.6005448, longitude: -93.60910639999997, start_date: "2016-07-08", date: "July 8-9, 2016", location: "Des Moines, IA", website: "http://2014.80-35.com/", description: "The eighth annual 80/35 presented by U.S. Cellular will take place on Friday and Saturday, July 10 and 11, 2015, at Western Gateway Park in downtown Des Moines, Iowa. The indie and jam music festival will feature nearly 50 acts on three stages. 80/35 draws more than 30,000 people every year and is organized by the Greater Des Moines Music Coalition (DMMC), a non-profit movement committed to building a stronger and more diverse live music economy.\r\n", price: nil, camping: " No", end_date: "2016-07-09"},
  {name: "British Summer Time 2016", latitude: 51.507268, longitude: -0.16572999999993954, start_date: "2016-07-02", date: "July 2-9, 2016", location: "London, UK", website: "http://www.bst-hydepark.com/", description: nil, price: 0, camping: " No", end_date: "2016-07-09"},
  {name: "NOS Alive 2016", latitude: 38.69673909999999, longitude: -9.231573799999978, start_date: "2016-07-07", date: "July 7-9, 2016", location: "Lisbon, Portugal", website: "http://www.nosalive.com/en/", description: "NOS Alive, formerly Optimus Alive, is the leading music festival in Portugal and has caught the rest of the world’s attention due to a single combination of an eclectic line up, warm weather and unique coastline location.\r\n", price: 0, camping: " Yes", end_date: "2016-07-09"},
  {name: "18HRS Festival 2016", latitude: 52.4420399, longitude: 4.829199199999948, start_date: "2016-07-09", date: "July 9, 2016", location: "Zaandam, Netherlands", website: "http://18hrsfestival.nl/", description: "As every year, we will return to the Balkenhaven festival site in Zaandam(near Amsterdam). Doors open at 12PM and we won’t stop before it’s 6AM and you can see the sun rise over the North Sea Channel. After 11:00 PM the music stops at the outdoor stages and you can continue partying inside the massive old factory, which is part of the festival site.\r\n", price: nil, camping: " No", end_date: "2016-07-09"},
  {name: "Bazant Pohoda Festival 2016", latitude: 48.8682643, longitude: 18.00983980000001, start_date: "2016-07-07", date: "July 7-9, 2016", location: "Airport Trencin, Slovakia", website: "http://www.pohodafestival.sk/", description: "MAIN FESTIVAL PROGRAM CONSISTS OF MUSIC OF MANY GENRES, BANDS REPRESENTING ROCK, PUNK, FOLK, ROCKABILY, WORLD MUSIC, REGGAE, SKA, POP, JAZZ, RAVE, AND MANY GENRES OF DANCE MUSIC, FOLKLORE BUT ALSO CLASSIC MUSIC HAVE PERFORMED AT THE FESTIVAL. THERE ARE ALSO THEATRE PERFORMANCES, BALLET AND MODERN DANCE, FILM, PRESENTATION OF LITERATURE, DESIGN AND VISUAL ART, DISCUSSIONS ON DIFFERENT ACTUAL TOPICS AS WELL AS PRESENTATIONS OF NON-PROFIT ORGANIZATIONS.\r\n", price: 0, camping: " Yes", end_date: "2016-07-09"},
  {name: "Electric Beach Festival 2016", latitude: 50.4189916, longitude: -5.09744169999999, start_date: "2016-07-08", date: "July 8-9, 2016", location: "Newquay, UK", website: "http://electricbeachfestival.co.uk/", description: "This Summer, on Saturday the 28th July, the golden sands of Watergate Bay, near Newquay, will be transformed into the first ever Electric Beach -  American Hip Hop legends - De La Soul will be Headlining this incredible festival with a vast array of other spectacular acts and performances throughout the day.\r\n", price: 0, camping: " No", end_date: "2016-07-09"},
  {name: "NASS Festival 2016", latitude: 51.0587013, longitude: -2.949906599999963, start_date: "2016-07-08", date: "July 8-10, 2016", location: "Somerset, UK", website: "http://www.nassfestival.com/", description: "NASS is three days of raw action sports, music and party-hard living. Land at NASS and you'll find yourself smack bang in a world where ravers and athletes go BIG...  No matter if you’re moshing at main stage, raving in The Warehouse or watching our World Class Skaters, Inliners and BMXers killing it in the pro park, there’s not a minute of the day that isn't going off at NASS. \r\n", price: 0, camping: " Yes", end_date: "2016-07-10"},
  {name: "Cavendish Beach 2016", latitude: 46.49126099999999, longitude: -63.37867399999999, start_date: "2016-07-08", date: "July 8-10, 2016", location: "Cavendish, Prince Edward Island", website: "http://cavendishbeachmusic.com/", description: nil, price: 0, camping: " Yes", end_date: "2016-07-10"},
  {name: "Ruisrock 2016", latitude: 60.4518126, longitude: 22.266630299999974, start_date: "2016-07-08", date: "July 8-10, 2016", location: "Turku, Finland", website: "http://www.ruisrock.fi/", description: "RUISROCK IS FINLAND'S LARGEST ROCK FESTIVAL HELD ANNUALLY IN TURKU, FINLAND DURING THE FIRST WEEKEND OF JULY. RUISROCK, FOUNDED IN 1970, IS THE SECOND OLDEST ROCK FESTIVAL IN EUROPE AND THE OLDEST IN FINLAND. THE FESTIVAL IS HELD IN THE BEAUTIFUL RUISSALO ISLAND BY THE BALTIC SEA SURROUNDED BY NATURE RESERVE. THE FESTIVAL IS LOCATED 5 KM FROM TURKU TOWN CENTRE AND IS EASILY ACCESSIBLE BY FESTIVAL SHUTTLE BUS. RUISROCK FESTIVAL HAS ATTRACTED TENS OF THOUSANDS OF VISITORS TO ENJOY THE FESTIVAL ATMOSPHERE FOR 44 CONSECUTIVE YEARS. EACH YEAR THE FESTIVAL HOSTS BOTH LOCAL TOP ARTISTS AND INTERNATIONAL STARS.\r\n", price: 135, camping: " Yes", end_date: "2016-07-10"},
  {name: "T in the Park 2016", latitude: 56.49067119999999, longitude: -4.2026458000000275, start_date: "2016-07-08", date: "July 8-10, 2016", location: "Perthshire, Scotland", website: "http://www.tinthepark.com/home.aspx", description: "FROM ITS BEGINNINGS AT STRATHCLYDE COUNTRY PARK, WITH 17,000 MUSIC FANS ATTENDING IN 1994, TO THE LUSH ENVIRONS OF BALADO IN 1997, TITP HAS GROWN IN SIZE (NOW 85,000 CAPACITY) AND INFLUENCE TO BECOME ONE OF THE MOST IMPORTANT AND CRITICALLY ACCLAIMED MUSIC EVENTS ON THE INTERNATIONAL FESTIVAL CIRCUIT.\r\n", price: 0, camping: " Yes", end_date: "2016-07-10"},
  {name: "Balaton Sound 2016", latitude: 46.8840799, longitude: 17.958094699999947, start_date: "2016-07-06", date: "July 6-10, 2016", location: "Zamardi, Hungary", website: "http://www.balatonsound.com/", description: "Seaside lounges, restaurants, bars and anything you need to enjoy the Balaton sunset, plus a great number of stars on several stages, that’s the already beloved concept of Balaton Sound. The event attracts approx. 100 000 visitors each year and turns Zamárdi, a small town on the southern shores of Lake Balaton into a massive party arena. The festival’s venue is a picturesque beach resort at the biggest lake of Central Europe, also regarded as a touristic center of the region.\r\n", price: 0, camping: " Yes", end_date: "2016-07-10"},
  {name: "Cornbury Music Festival 2016", latitude: 51.7612056, longitude: -1.2464674000000286, start_date: "2016-07-08", date: "July 8-10, 2016", location: "Oxfordshire, UK", website: "http://www.cornburyfestival.com/", description: nil, price: nil, camping: " Yes", end_date: "2016-07-10"},
  {name: "Henley Festival 2016", latitude: 51.535764, longitude: -0.9028940000000603, start_date: "2016-07-06", date: "July 6-10, 2016", location: "Henley-on-Thames, UK", website: "http://www.henley-festival.co.uk/", description: "Henley Festival, where revellers wear black tie, food is catered by Michelin starred chefs and each night ends in a magical firework display, is one of the UK’s most unique festivals. As a non-camping festival, Henley is the perfect antidote to watching music in a muddy field, offering festival goers a one of a kind festival experience that continues to grow from year to year, with an audience of 35,000 people expected.\r\n", price: 0, camping: " No", end_date: "2016-07-10"},
  {name: "EXIT Festival 2016", latitude: 45.25, longitude: 19.850000000000023, start_date: "2016-07-07", date: "July 7-10, 2016", location: "Novi Sad, Serbia", website: "http://www.exitfest.org/en", description: "For those of you tired of festivaling in a field, check out this Serbian festival. One of longest running music festivals in the East, the annual EXIT Festival distinguishes itself by being held in an ancient Petrodovian fortress. The constantly evolving festival has recently added a sister festival held on the shores of the Adriatic Sea. \r\n", price: 110, camping: " Yes", end_date: "2016-07-10"},
  {name: "Center of Gravity 2016", latitude: 49.8879519, longitude: -119.49601059999998, start_date: "2016-07-08", date: "July 8-10, 2016", location: "Kelowna, BC", website: "http://centerofgravity.ca/", description: "Mixing a music festival and sports (and bikinis) is a winning combination for this festival in Kelowana, British Columbia. EDM and hip-hop artists play against a backdrop of beaches, volleyball, wakeboarding, and mountain biking professional atheletes.  \r\n", price: 0, camping: " No", end_date: "2016-07-10"},
  {name: "Winnipeg Folk Festival 2016", latitude: 49.8997541, longitude: -97.1374937, start_date: "2016-07-07", date: "July 7-10, 2016", location: "Winnipeg, MB", website: "http://www.winnipegfolkfestival.ca/festival/", description: "The Winnipeg Folk Festival is a fabulous outdoor music festival, on the second weekend of every July, in Birds Hill Park, Manitoba. Year-round, we present live music, music training, and arts events, and operate a music store in Winnipeg, Canada.\r\n", price: 0, camping: " Yes", end_date: "2016-07-10"},
