  {name: "Les Deferlantes 2016", latitude: 42.546214, longitude: 3.022911000000022, start_date: "2016-07-07", date: "July 7-10, 2016", location: "Argeles Sur Mer, France", website: "http://www.festival-lesdeferlantes.com/fr", description: nil, price: 0, camping: " Yes", end_date: "2016-07-10"},
