  {name: "Worldwide Festival Sete 2016", latitude: 43.4078758, longitude: 3.700821899999937, start_date: "2016-07-04", date: "July 4-10, 2016", location: "Sete, France", website: "http://www.worldwidefestival.com/", description: "WITH ITS UNIQUE LINE-UP OF ARTISTS, THE WF AIMS TO WELCOME FESTIVAL GOERS TO ITS EXCEPTIONAL VENUES IN VARIOUS CITIES AROUND THE WORLD, AND TO HIGHLIGHT THE AUTHENTICITY AND RICH CULTURE OF THESE CITIES. THE WORLDWIDE FESTIVAL CULTIVATES THIS SPECIFIC AIM AND OFFERS A UNIQUE HOLIDAY EXPERIENCE, WITH THE IDEA BEING TO CREATE SEVERAL WF EVENTS THROUGHOUT THE YEAR IN DIFFERENT PARTS OF THE WORLD.\r\n", price: 0, camping: " No", end_date: "2016-07-10"},
  {name: "The Ride Festival 2016", latitude: 37.9374939, longitude: -107.81228520000002, start_date: "2016-07-09", date: "July 9-10. 2016", location: "Telluride, CO", website: "http://www.ridefestival.com/", description: "The weekend kicks off on Friday, July 10, with a FREE outdoor sunset concert in the scenic Mountain Village. Hop on the free gondola from Telluride to Mountain Village and the view will set the stage for this amazing music-filled weekend .\r\n", price: nil, camping: " Yes", end_date: "2016-07-10"},
