  {name: "Brooklyn Hip Hop Festival 2016", latitude: 0.0, longitude: 0.0, start_date: "2016-07-13", date: "July 13-16, 2016", location: "Brooklyn, NY", website: "http://www.bkhiphopfestival.com/", description: "As New York City's largest Hip-Hop cultural event, the Festival showcases the positive aspects of Hip-Hop culture by highlighting Hip-Hop's legacy as an agent of artistic progression, community building and social change. BHF 2012 events will continue to reflect the full range of Hip-Hop culture, which spans music, film, academics, grassroots empowerment and more.\r\n", price: nil, camping: " No", end_date: "2016-07-16"},
  {name: "Camp Bisco 2016", latitude: 41.347976, longitude: -75.66388899999998, start_date: "2016-07-14", date: "July 14-16, 2016", location: "Scranton, PA", website: "http://campbisco.com/", description: nil, price: 0, camping: " Yes", end_date: "2016-07-16"},
  {name: "Rock Fest Wisconsin 2016", latitude: 44.94801870000001, longitude: -91.15070309999999, start_date: "2016-07-14", date: "July 14-16, 2016", location: "Cadott, WI", website: "http://www.rock-fest.com/", description: "A City literally built on Rock n' Roll, Rock Fest is a true ROCK experience you can't miss. Featuring only the best of active and classic rock and legendary names in Rock Music, entertainment is first priority. Set on 320 acres in Central Wisconsin and home to nearly 8,000 campsites with major hotels nearby, there is literally something for every rock music fan.\r\n", price: 0, camping: " Yes", end_date: "2016-07-16"},
  {name: "Calgary Stampede 2016", latitude: 51.038804, longitude: -114.0536386, start_date: "2016-07-08", date: "July 8-17, 2016", location: "Calgary, AB", website: "http://cs.calgarystampede.com/", description: "THE CALGARY STAMPEDE IS A VOLUNTEER-SUPPORTED, NOT-FOR-PROFIT ORGANIZATION THAT PRESERVES AND PROMOTES WESTERN HERITAGE AND VALUES. BEST KNOWN FOR THE WORLD-RENOWNED 10-DAY EVENT, THE CALGARY STAMPEDE IS ACTIVE YEAR-ROUND.\r\n", price: nil, camping: " No", end_date: "2016-07-17"},
  {name: "Positivus Festival 2016", latitude: 57.7581391, longitude: 24.354345500000022, start_date: "2016-07-15", date: "July 15-17, 2016", location: "Salacgriva, Latvija", website: "https://www.positivusfestival.com/en/", description: "One of our picks for a undiscovered gem – Postivius takes place in the pretty coastal town of Salacgriva in Latvia. The lineup includes international headliners, underground talent, and plenty of art – all of which combine into one super-chill festival.\r\n", price: 65, camping: " Yes", end_date: "2016-07-17"},
  {name: "FIB 2016", latitude: 40.055385, longitude: 0.06415040000001682, start_date: "2016-07-14", date: "July 14-17. 2016", location: "Benicassim, Spain", website: "http://fiberfib.com/", description: nil, price: nil, camping: " Yes", end_date: "2016-07-17"},
  {name: "Quebec City Summer Festival 2016", latitude: 46.8032826, longitude: -71.242796, start_date: "2016-07-07", date: "July 7-17, 2016", location: "Quebec City, QC", website: "http://www.infofestival.com/Home/", description: "For those of you seeking a music festival and a taste of old world charm, check out the mammoth Quebec City Summer Festival. Stretching for an astounding eleven days, historic Quebec City is overrun by an astounding 1.5 million fans. There’s plenty of other activities happening in Canada’s French-iest city. As they say on their website: “During the Festival, the whole city is celebrating!”\r\n", price: nil, camping: " No", end_date: "2016-07-17"},
  {name: "Electric Castle Festival 2016", latitude: 46.910183, longitude: 23.810216999999966, start_date: "2016-07-14", date: "July 14-17. 2016", location: "Bonțida, Romania", website: "http://www.electriccastle.ro/", description: "Held on the domain of Bánffy Castle (or Bonțida Bánffy Castle), the festival wants to be more than a concert extension and tries to offer a full experience to the participants by creating a mix between the unique location, filled with beauty and history, all day round urban activities (like extreme sports, audio-video production workshops) and a large variety of electronic music.\r\n", price: 329, camping: " Yes", end_date: "2016-07-17"},
  {name: "Colours of Ostrava 2016", latitude: 49.8209226, longitude: 18.262524299999995, start_date: "2016-07-14", date: "July 14-17, 2016", location: "Ostrava, Czech", website: "http://www.colours.cz/", description: "Set in a venue filled with the remnants of blast furnaces, mines and ironworks, Colours of Ostrava fills this industrial complex with music and festies. Wander around the amazing grounds and check out some of the other offerings which include film, theater, workshops, discussions, and poetry. \r\n", price: 1990, camping: " No", end_date: "2016-07-17"},
  {name: "Ultra Europe 2016", latitude: 43.5081323, longitude: 16.440193499999964, start_date: "2016-07-15", date: "July 15-17, 2016", location: "Split, Croatia", website: "http://www.ultraeurope.com/home", description: nil, price: 0, camping: " No", end_date: "2016-07-17"},
  {name: "Melt! Festival 2016", latitude: 51.7582836, longitude: 12.447138300000006, start_date: "2016-07-15", date: "July 15-17, 2016", location: "Ferropolis, Germany", website: "http://www.meltfestival.de/", description: "MELT! FROM A DISTANCE: A BRIGHT BALL OF FIRE, A BURNING INFERNO, SURROUNDED BY THE LAKE GREMMIN AND THE SILENCE OF THE NIGHT. INDESCRIBABLY BEAUTIFUL. UP CLOSE, REVEALED AN EXTRAORDINARY MICROCOSM BETWEEN LOUD AND QUIET, GUITARS AND BEATS, INDUSTRY AND NATURE. MELT! PUTS TOGETHER WHAT BELONGS TOGETHER ONLY AT THIS MAGICAL PLACE FERROPOLIS - THE CITY OF IRON. AND WHEN THE SUN RISES BETWEEN THE STEEL GIANTS, WHICH ONCE SUPPLIED THE EAST OF GERMANY WITH COAL, WE ALL GET THIS MELT! FEELING.\r\n", price: 0, camping: " Yes", end_date: "2016-07-17"},
  {name: "Northwest String Summit 2016", latitude: 45.5970596, longitude: -122.9934389, start_date: "2016-07-14", date: "July 14-17, 2016", location: "North Plains, OR", website: "http://stringsummit.com/", description: "AT BEAUTIFUL HORNING'S HIDEOUT IN NORTH PLAINS, OREGON. AS WITH EVERY YEAR, OUR PERENNIAL HOSTS YONDER MOUNTAIN STRING BAND WILL PLAY 6 SETS OF MUSIC ALONG WITH MANY, MANY OTHERS TO BE ANNOUNCED.\r\n", price: 0, camping: " Yes", end_date: "2016-07-17"},
  {name: "Latitude Festival 2016", latitude: 52.32562799999999, longitude: 1.6801809999999477, start_date: "2016-07-14", date: "July 14-17, 2016", location: "Suffolk, UK", website: "http://www.latitudefestival.com/", description: "Latitude, the pioneering, award-winning festival bursts with the very best from Music and the Arts; wander from Film to Music, Comedy to Literature and Theatre to Poetry in the stunning setting of Henham Park in the Suffolk countryside. Set in fairylight-lit woods, a lake and featuring a flock of multicoloured sheep, it really is the cultural highlight of the summer festival season.\r\n", price: 0, camping: " Yes", end_date: "2016-07-17"},
  {name: "Dour Festival 2016", latitude: 50.4000126, longitude: 3.782791800000041, start_date: "2016-07-13", date: "July 13-17, 2016", location: "Dour, Belgium", website: "http://www.dourfestival.be/en", description: nil, price: 0, camping: " Yes", end_date: "2016-07-17"},
  {name: "Larmer Tree 2016", latitude: 51.068785, longitude: -1.7944720000000416, start_date: "2016-07-13", date: "July 13-17, 2016", location: "Salisbury, UK", website: "http://larmertreefestival.co.uk/", description: "Founded by Festival Director James Shepard in the summer of 1990, a  quarter of a century ago, with an audience of just 100 people and 12   hours of music, 25 years on, Larmer Tree Festival draws in crowds of up   to 5,000 a day for a full five-day extravaganza.  With its eclectic and varied blend of music, comedy and activities  for all ages, this original boutique festival delivers five magical days in   the intimate grounds of Larmer Tree Gardens, near Salisbury on the   Wiltshire/Dorset border.  With six unique stages spread across the festival site, festival-goers can immerse themselves in a variety of music  with well established artists playing alongside emerging talent.\r\n", price: 0, camping: " Yes", end_date: "2016-07-17"},
  {name: "Ottawa Bluesfest 2016", latitude: 45.413947, longitude: -75.71467439999998, start_date: "2016-07-07", date: "July 7-17, 2016", location: "Ottawa, ON", website: "http://ottawabluesfest.ca/", description: "Winning the title for “festival that sounds least like its name”, the Ottawa Bluesfest hits almost every genre even including a little bit of blues. Starting as a small fest over twenty years ago, they have grown exponentially to a ten-day mult-stage event that’s one of the highlights of the Canadian summer. \r\n", price: nil, camping: " No", end_date: "2016-07-17"},
