  {name: "Chagstock 2016", latitude: 50.77721349999999, longitude: -3.9994609999999966, start_date: "2016-07-22", date: "July 22-23, 2016", location: "Devon, UK", website: "http://www.chagstock.info/", description: "CHAGSTOCK FESTIVAL IS ONE OF THE WESTCOUNTRY’S BEST-LOVED FESTIVALS. SET IN 70 ACRES OF FARMLAND ON THE EDGE OF DARTMOOR, CHAGSTOCK IS RENOWNED FOR ITS STUNNING LOCATION, DIVERSE LINE-UP OF ARTISTS AND NON-CORPORATE, FAMILY FRIENDLY ATMOSPHERE. CHAGSTOCK SHOWCASES THE VERY BEST MUSIC, FOOD AND ENTERTAINMENT THAT THE WESTCOUNTRY AND THE UK HAVE TO OFFER.\r\n", price: 0, camping: " Yes", end_date: "2016-07-23"},
  {name: "The Wickerman Festival 2016", latitude: 54.8176583, longitude: -3.9272521000000324, start_date: "2016-07-22", date: "July 22-23, 2016", location: "Dundrennan, Scotland", website: "http://www.thewickermanfestival.co.uk/", description: "WICKERMAN IS ONE OF THE UKS BEST-LOVED INDEPENDENT MUSIC FESTIVALS AND IS NOW ENTERING ITS 13TH CONSECUTIVE YEAR. WITH TEN STAGES FEATURING AN ECLECTIC AND EXCITING MIX OF LEADING ARTISTS, ALTERNATIVE ACTS AND UP-AND-COMING TALENT, THE TWO DAY SUMMER PARTY CATERS FOR ALL MUSICAL TASTES. THE WICKERMAN SITE IS A WONDERLAND FOR ADULTS AND CHILDREN ALIKE WITH A CINEMA, FUN FAIR, CIRCUS ENTERTAINMENT, SEGWAY HIRE, MOUNTAIN BIKING AND ARRAY OF ARTS AND CRAFT ACTIVITIES SCATTERED THROUGHOUT ITS FIELDS. HIGH QUALITY YURTS, TIPIS AND CLOUD HOUSES AND SPACIOUS CAMPSITES COMPLETE THE MAGICAL FESTIVAL EXPERIENCE. EVERY YEAR THE FESTIVAL STAGES AN UNFORGETTABLE FINALE, AS THOUSANDS OF FANS FLOCK TO WATCH A TOWERING 40FT WICKERMAN BE SPECTACULARLY SET ALIGHT.\r\n", price: 0, camping: " Yes", end_date: "2016-07-23"},
