  {name: "Capitol Hill Block Party 2016", latitude: 47.6062095, longitude: -122.3320708, start_date: "2016-07-22", date: "July 22-24, 2016", location: "Seattle, WA", website: "http://capitolhillblockparty.com/", description: "Named by USA Today’s “Pop Candy” as one of the “Twelve reasons to visit Seattle”, CHBP offers outstanding musical performances. In addition, the festival features resident art galleries, restaurants, clubs, and stores that help define Seattle as a cultural hub. CHBP’s reputation for bringing the best in regional and touring indie artists to the stage has drawn 10,000 people a day for sold out shows year after year. The Capitol Hill Block Party showcases over 100 of the best Northwest and national bands and DJ’s.\r\n", price: nil, camping: " No", end_date: "2016-07-24"},
  {name: "Tomorrowland 2016", latitude: 51.08608, longitude: 4.366330000000062, start_date: "2016-07-22", date: "July 22-24, 2016", location: "Boom, Belgium", website: "http://www.tomorrowland.com/home", description: nil, price: 0, camping: " Yes", end_date: "2016-07-24"},
  {name: "XPoNential Music Festival 2016", latitude: 39.9259463, longitude: -75.11961989999998, start_date: "2016-07-22", date: "July 22-24, 2016", location: "Camden, NJ", website: "http://xpnfest.org/", description: "The XPoNential Music Festival presented by Subaru offers an unparalleled experience for music discovery. With a lineup of established and up-and-coming artists heard on WXPN 88.5FM, the award-winning Philadelphia public radio station, along with a variety of family-friendly activities, the XPoNential Music Festival has been pleasing audiences of all ages for more than a decade on the Camden Waterfront.\r\n", price: 0, camping: " No", end_date: "2016-07-24"},
  {name: "Newport Folk Festival 2016", latitude: 41.4788755, longitude: -71.33622409999998, start_date: "2016-07-22", date: "July 22-24, 2016", location: "Newport, RI", website: "http://www.newportfolk.org/", description: nil, price: nil, camping: " Yes", end_date: "2016-07-24"},
