  {name: "Future Forest 2016", latitude: 46.0250016, longitude: -66.92405250000002, start_date: "2016-07-22", date: "July 22-26, 2016", location: "Fredericton, NB", website: "http://futurefest.ca/2015/", description: nil, price: 0, camping: " Yes", end_date: "2016-07-26"},
  {name: "Metaldays 2016", latitude: 46.1857188, longitude: 13.731983799999966, start_date: "2016-07-24", date: "July 24-30, 2016", location: "Tolmin, Slovenia", website: "http://metaldays.net/Home", description: "The METALDAYS Festival will present you a friendly and absolutely relaxed atmosphere, perfect for you to just forget about all worries and enjoy your most likely best holiday ever!   The festival is located at Sotocje, which lies inbetween the two mountain rivers called Tolminka and Soca. METALDAYS has two \"festival-owned\" beaches for you to relax on. But the two rivers aren't the only reason Sotocje  is that beautiful: Tolmin is located only approx. 65 kilometers off the coast of the Mediterranean Sea, which really gives you that holiday feel. Also the road you're travelling on will lead you through the Alps, a scenerie that will astonish both full grown metalheads and families with children alike. The METALDAYS area is also part of the Julijske Alpe National Parks, and the river Soca is one of the cleanest in Europe. \r\n", price: 109, camping: " Yes", end_date: "2016-07-30"},
  {name: "Into the Valley 2016", latitude: 60.948409, longitude: 15.104855000000043, start_date: "2016-07-29", date: "July 29-30, 2016", location: "Rattvik, Sweden", website: "http://www.intothevalley.se/itv/", description: "segrén hedlund and dalhalla presents into the valley — a two day celebration of electronic music where one of sweden’s most unique venues is rebuilt to an open air club.\r\n", price: nil, camping: " Yes", end_date: "2016-07-30"},
  {name: "Lake Festival 2016", latitude: 46.9680231, longitude: 15.402443800000015, start_date: "2016-07-28", date: "July 28-30, 2016", location: "Unterpremstätten, Austria", website: "http://www.lake-festival.at/en/", description: nil, price: 0, camping: " Yes", end_date: "2016-07-30"},
  {name: "Bass Center 2016", latitude: 39.8083196, longitude: -104.93386750000002, start_date: "2016-07-29", date: "July 29-30, 2016", location: "Denver, CO", website: "http://www.bassnectar.net/2016/01/bass-center-2016/", description: nil, price: 0, camping: " Yes", end_date: "2016-07-30"},
  {name: "Leefest 2016", latitude: 51.3093239, longitude: -0.05590099999994891, start_date: "2016-07-28", date: "July 28-30, 2016", location: "Warlingham, UK", website: "http://www.leefest.org.uk/", description: "LeeFest is an award winning non-profit music festival in South London with easy access from Bromley and Croydon. \r\n", price: nil, camping: " Yes", end_date: "2016-07-30"},
  {name: "Lollapalooza Chicago 2016", latitude: 41.8741516, longitude: -87.62080609999998, start_date: "2016-07-28", date: "July 28-31, 2016", location: "Chicago, IL", website: "http://www.lollapalooza.com/", description: "It’s loud. It’s messy. It’s Lollapalooza. You got to hand it Perry Farrell, the bizarre and quirky visionary who reinvented the American music festival with Lollapalooza first taking it on the road in the last century and then putting down stakes in Chicago. Despite a firm homebase in the Windy City, Lolla hasn’t forgotten its traveling roots with editions in South America and Europe. \r\n", price: nil, camping: " No", end_date: "2016-07-31"},
  {name: "Osheaga 2016", latitude: 45.514307, longitude: -73.53408300000001, start_date: "2016-07-29", date: "July 29-31, 2016", location: "Montreal, QC", website: "http://www.osheaga.com/", description: "Osheaga started as a vision to bring a giant European style festival to Canada. It’s safe to say they've succeeded. Osheaga consistently brings a world-class lineup to the shores of Ile Sainte-Helene during the height of summer. It’s become so popular that organizers have added a second weekend of just metal (Heavy Montreal) and a third weekend of EDM (IleSoniq).\r\n", price: 0, camping: " No", end_date: "2016-07-31"},
  {name: "Y Not Festival 2016", latitude: 53.12933409999999, longitude: -1.714537899999982, start_date: "2016-07-29", date: "July 29-31, 2016", location: "Derbyshire, UK", website: "http://www.ynotfestivals.co.uk/", description: "For one weekend a year, the gorgeous Peak District countryside becomes home to the Y Not Festival. Y Not is the Small, Fresh & Loud music festival, with a fantastic atmosphere and a history of amazing live acts.\r\n", price: 0, camping: " Yes", end_date: "2016-07-31"},
  {name: "Standon Calling 2016", latitude: 51.88368999999999, longitude: 0.026070000000004256, start_date: "2016-07-29", date: "July 29-31, 2016", location: "Standon, UK", website: "http://www.standon-calling.com/", description: nil, price: 0, camping: " Yes", end_date: "2016-07-31"},
  {name: "Camp Bestival 2016", latitude: 50.6371246, longitude: -2.201893700000028, start_date: "2016-07-28", date: "July 28-31, 2016", location: "Dorset, UK", website: "http://holding.campbestival.net/", description: "IT'S INSPIRED BY THE HALCYON DAYS OF SUMMERS PAST, IMAGINE THE 1950S BRITISH HOLIDAY CAMP WITH A TWIST AND YOU'LL GET CLOSE TO WHAT CAMP BESTIVAL IS ALL ABOUT. EXPECT TO BASK IN NOSTALGIA AND FITS OF GIGGLES AS THE BESTIVAL BLUECOATS, WITH THE MIGHTY MIGUEL FROM THE CUBAN BROTHERS AT THE HELM, LEAD YOU ON A MERRY JAUNT AROUND THE MOST BEAUTIFUL SITE IN THE WORLD DESIGNED BY JOSIE DA BANK.\r\n", price: 0, camping: " Yes", end_date: "2016-07-31"},
  {name: "Kendal Calling 2016", latitude: 54.5772323, longitude: -2.7974834999999985, start_date: "2016-07-28", date: "July 28-31, 2016", location: "Cumbria, UK", website: "http://www.kendalcalling.co.uk/", description: "Kendal Calling is the most fun you can have in the countryside with fields full of activities and attractions for everyone, from families to stag parties!\r\n", price: 0, camping: " Yes", end_date: "2016-07-31"},
  {name: "Rockygrass Festival 2016", latitude: 40.2247075, longitude: -105.27137800000003, start_date: "2016-07-29", date: "July 29-31, 2016", location: " Lyons, CO", website: "http://www.bluegrass.com/rockygrass/", description: "RockyGrass is held at the Planet Bluegrass Ranch in Lyons, Colorado - located along the wooded banks of the beautiful St. Vrain River. The historic quarry town of Lyons is just 15 miles north of Boulder in the foothills of the Rocky Mountains. The town is known for its antique stores, restaurants, artists, and musicians. \r\n", price: 0, camping: " Yes", end_date: "2016-07-31"},
  {name: "Floydfest 2016", latitude: 36.8317936, longitude: -80.34872039999999, start_date: "2016-07-27", date: "July 27-31, 2016", location: "Floyd, VA", website: "http://floydfest.com/", description: "The homegrown Floydfest has only one modest aim: “Our mission is to the be the best music experience of our time.” The lofty promise is generating results as each year the lineup gets deeper and the names get bigger. The famous Blue Ridge Parkway serves as your living room for the weekend.\r\n", price: 0, camping: " Yes", end_date: "2016-07-31"},
  {name: "Oregon Jamboree 2016", latitude: 44.3976247, longitude: -122.73619589999998, start_date: "2016-07-29", date: "July 29-31, 2016", location: "Sweet Home, OR", website: "http://oregonjamboree.com/", description: "NESTLED IN THE FOOTHILLS OF THE SCENIC CASCADE MOUNTAINS, THE OREGON JAMBOREE IS HELD ON 20+ ACRE PARK-LIKE SETTING THAT INCLUDES THE HISTORIC WEDDLE COVERED BRIDGE. THE JAMBOREE OFFERS A FULL FESTIVAL ATMOSPHERE IN THE MAIN VENUE AND A MORE INTIMATE CONCERT EXPERIENCE ON THE SECOND STAGE IN SANKEY PARK. IN ADDITION TO FEATURED HEADLINE ENTERTAINMENT, THIS FAMILY-STYLE EVENT HOSTS RV AND TENT CAMPING, FOOD BOOTHS, BEER & WINE GARDENS, AND A VARIETY OF OTHER ATTRACTIONS.\r\n", price: nil, camping: " Yes", end_date: "2016-07-31"},
  {name: "Mountain Home 2016", latitude: 43.13295039999999, longitude: -115.69119749999999, start_date: "2016-07-29", date: "July 29-31, 2016", location: "Mountain Home, ID", website: "http://mountainhomefestival.com/", description: nil, price: 0, camping: " Yes", end_date: "2016-07-31"},
  {name: "Cambridge Folk Festival 2016", latitude: 52.205337, longitude: 0.12181699999996454, start_date: "2016-07-28", date: "July 28-31, 2016", location: "Cambridge, UK", website: "http://www.cambridgefolkfestival.co.uk/", description: "THE FESTIVAL IS RENOWNED FOR ITS UNIQUE ATMOSPHERE AND AN ECLECTIC MIX OF MUSIC AND A WIDE DEFINITION OF WHAT MIGHT BE CONSIDERED FOLK. THE BEST TRADITIONAL FOLK ARTISTS FROM THE UK AND IRELAND RUB SHOULDERS WITH CUTTING EDGE CONTEMPORARY ACTS, THE FINEST AMERICAN COUNTRY, BLUES AND ROOTS ARTISTS, ACCLAIMED SINGER SONGWRITERS AND WORLD FAMOUS NAMES. BLUEGRASS, GOSPEL, CAJUN, ZYDECO, JAZZ, WORLD, KLEZMER AND CEILIDHS ARE ALSO REGULAR FEATURES. THE LINE UP HAS REFLECTED THE MANY CHANGES IN THE MUSIC SCENE FROM THE 60S TO THE PRESENT AND IS ALWAYS A HOTBED MIX OF THE OLD AND THE NEW.\r\n", price: 0, camping: " Yes", end_date: "2016-07-31"},
  {name: "Indietracks 2016", latitude: 53.122322, longitude: -1.5136820999999827, start_date: "2016-07-29", date: "July 29-31, 2016", location: "Derbyshire, UK", website: "http://www.indietracks.co.uk/", description: "Indietracks is a unique summer music festival which combines steam trains and indiepop music. It takes place at the Midland Railway Centre in the heart of the Derbyshire countryside. Visitors are free to enjoy steam train rides, railway attractions and museums, discos, art and craft workshops, great food and a selection of real ales.\r\n", price: 0, camping: " Yes", end_date: "2016-07-31"},
  {name: "Wacken 2016", latitude: 54.0226106, longitude: 9.379951600000027, start_date: "2016-08-04", date: "August 4-6, 2016", location: "Wacken, Germany", website: "http://www.wacken.com/en/", description: "361 DAYS A YEAR WACKEN IS A SMALL TOWN WITH 2000 SOULS IN THE MIDDLE OF SCHLESWIG HOLSTEIN, GERMANY. BUT FOR THREE DAYS IN AUGUST THE POPULATION INCREASES TO 75000.\r\n", price: 170, camping: " Yes", end_date: "2016-08-06"},
  {name: "WE Fest 2016", latitude: 46.8171808, longitude: -95.84532530000001, start_date: "2016-08-04", date: "August 4-6, 2016", location: "Detroit Lakes, MN", website: "http://wefest.com", description: "80,000 rowdy country fans descend on the tiny town of Detroit Lakes at this blowout. There’s ten campgrounds to stake out your territory with different areas for different lifestyles. And better leave the kids at home for this one — as the website states: “…we do not recommend that you bring your children.”\r\n", price: 0, camping: " Yes", end_date: "2016-08-06"},
  {name: "Hinterland Festival 2016", latitude: 41.565242, longitude: -93.66993000000002, start_date: "2016-08-05", date: "August 5-6, 2016", location: "Des Moines, IA", website: "http://hinterlandiowa.com/", description: "It’s a weekend of great music under the stars and skyline. It’s two days of music hand-picked by First Fleet’s Sam Summers for the gorgeous backdrop of Water Works Park, a 1,500 acre oasis in the center of our city. In our first year, Hinterland will feature a diverse blend of relevant artists, cyclist events, on-site sculpture and art installations, craft vendors, family engagement and more.\r\n", price: nil, camping: " No", end_date: "2016-08-06"},
  {name: "IleSoniq 2016", latitude: 45.502410788013776, longitude: -73.52708723779295, start_date: "2016-08-05", date: "August 5-6, 2016", location: "Montreal, QC", website: "http://www.ilesoniq.com/", description: nil, price: nil, camping: " No", end_date: "2016-08-06"},
  {name: "Belladrum Tartan Heart Festival 2016", latitude: 57.483411, longitude: -4.460350999999946, start_date: "2016-08-04", date: "August 4-6, 2016", location: "Beauly, Scotland", website: "http://www.tartanheartfestival.co.uk/", description: nil, price: 0, camping: " Yes", end_date: "2016-08-06"},
  {name: "Rise Above Fest 2016", latitude: 44.80118210000001, longitude: -68.77781379999999, start_date: "2016-08-06", date: "August 6, 2016", location: "Bangor, ME", website: "http://riseabovefest.com/", description: nil, price: 0, camping: " No", end_date: "2016-08-06"},
  {name: "The Werk Out 2016", latitude: 39.896454, longitude: -82.4201539, start_date: "2016-08-04", date: "August 4-6, 2016", location: "Thornville, OH", website: "http://www.thewerkoutfestival.com/site/", description: "The festival brings awareness to musical styles that are the backbone of the vibrant music scene in the Midwest. It serves as showcase in a shared playground between artist and participant and draws people from all across the United States. The festival is the of the product of the band, The Werks, Funky Bean Productions and AlchemyHouse Presents.\r\n", price: 0, camping: " Yes", end_date: "2016-08-06"},
  {name: "Eastern Electrics 2016", latitude: 51.760453, longitude: -0.20922799999993913, start_date: "2016-08-06", date: "August 6, 2016", location: "London, UK", website: "http://easternelectrics.com/", description: "Undoubtedly one of the biggest all-dayers in the festival calendar, Eastern Electrics Festival has grown into the premier party of the summer for electronic music lovers across the country. Returning on Saturday August 6th to it’s stunning countryside home at Hatfield House, Hertford, the Eastern Electrics family will once again present the cream of the house, techno, garage and bass crop across nine festival stages hosted by the worlds biggest electronic music icons.\r\n", price: 0, camping: " No", end_date: "2016-08-06"},
  {name: "Cambridge Rock Festival 2016", latitude: 52.196117, longitude: 0.06930869999996503, start_date: "2016-08-04", date: "August 4-7, 2016", location: " Cambridge, UK", website: "http://cambridgerockfestival.co.uk/", description: "A superb Rock Festival featuring mainly Rock and Blues, with added Prog, NWBHM, great food and 70 real ales, ciders, wines and lager! Camping and caravanning available over the full festival. Just 2.5 miles from the historic centre of Cambridge and 3.3miles from Cambridge Rail Station. \r\n", price: 0, camping: " Yes", end_date: "2016-08-07"},
  {name: "Heavy Montreal 2016", latitude: 45.512289, longitude: -73.53337099999999, start_date: "2016-08-05", date: "August 5-7, 2016", location: "Montreal, QC", website: "http://heavymontreal.com/", description: "Like its more mainstream counterpart Osheaga, Heavy Montreal channels the vibe of the best open air European festivals but in metal form. Maybe it’s the sunshine, maybe it’s Canadians, but the crowd has to be one of the friendliest crowds we’ve ever partied with. Simply one of the best destinations in North America for fans of rock, punk, and metal.  \r\n", price: nil, camping: " No", end_date: "2016-08-07"},
  {name: "Squamish Valley Music Festival 2016", latitude: 49.7016339, longitude: -123.15581209999999, start_date: "2016-08-05", date: "August 5-7, 2016", location: "Squamish, BC", website: nil, description: nil, price: nil, camping: nil, end_date: "2016-08-07"},
  {name: "OZORA Festival 2016", latitude: 46.769561, longitude: 18.43696369999998, start_date: "2016-08-01", date: "August 1-7, 2016", location: "Dádpuszta, Hungary", website: "https://ozorafestival.eu/", description: "Reaching out into the deepest realms of your imagination and displaying, sharing that glorious, that grotesque, that unparalleled treasure you find within is one of the pillars of the Ozora experience. The experience of a parallel existence created by our diversely colored dreams and visions of the same pure unblemished space, paradise on earth, our fairy tale.\r\n", price: nil, camping: " Yes", end_date: "2016-08-07"},
  {name: "Untold Festival 2016", latitude: 46.766667, longitude: 23.58333300000004, start_date: "2016-08-04", date: "August 4-7, 2016", location: "Cluj, Romania", website: "https://untoldfestival.com/en/", description: nil, price: nil, camping: " Yes", end_date: "2016-08-07"},
  {name: "Boots and Hearts 2016", latitude: 43.9126042, longitude: -78.688019, start_date: "2016-08-04", date: "August 4-7, 2016", location: "Bowmanville, ON", website: "http://bootsandhearts.com/", description: "BOOTS AND HEARTS IS THE LARGEST COUNTRY MUSIC FESTIVAL OF ITS KIND EVER TO BE HOSTED ON CANADIAN SOIL. IT IS A THREE-DAY CELEBRATION OF MUSIC AND ART WHERE MUSIC LOVERS OF ALL GENRES CAN ESCAPE FROM THE RIGORS OF DAILY LIFE, BAND TOGETHER WITH THOUSANDS OF OTHER COUNTRY MUSIC FANS AND EXPERIENCE A ONCE-IN-A-LIFETIME EVENT THAT THEY WILL NEVER FORGET.\r\n", price: 0, camping: " Yes", end_date: "2016-08-07"},
  {name: "Pickathon 2016", latitude: 45.446787, longitude: -122.53036880000002, start_date: "2016-08-05", date: "August 5-7, 2016", location: "Happy Valley, OR", website: "http://pickathon.com/", description: "THERE'S PLENTY THAT COULD BE SAID ABOUT PICKATHON: THE DIVERSE AND EXPERTLY CRAFTED LINEUP; THE FESTIVAL'S PIONEERING WAYS IN ZERO-WASTE FOOD AND BEVERAGE SERVICE; THE CELEBRATION OF PORTLAND'S FOOD-TRUCK CULTURE; SIX STAGES CREATING UNIQUE ENVIRONMENTS FOR THE PERFORMERS, WHO ALL PLAY TWICE OVER THE COURSE OF THE WEEKEND; THE EMPHASIS OF QUALITY OVER QUANTITY, WITH A 3500 PAID ATTENDANCE CAPACITY; THE FAMILY-FRIENDLY ENVIRONMENT.\r\n", price: 0, camping: " Yes", end_date: "2016-08-07"},
  {name: "Arise Music Festival 2016", latitude: 40.448109, longitude: -105.219132, start_date: "2016-08-05", date: "August 5-7, 2016", location: "Loveland, CO", website: "http://www.arisefestival.com", description: "Located in Loveland, Colorado the ARISE Music Festival features 3 days of Music, Yoga, Workshops and co-creative experiences of all kinds. Surrounded by national forest, the festival takes place at Sunrise Ranch – an oasis in the heart of Colorado’s legendary Front Range. Featuring sweeping vistas and beautiful meadows, this magical and secluded landscape is a perfect container for participants to entertain and be entertained, be inspired, explore their creative potentials, connect with nature, stretch out, dive in, and get down.\r\n", price: 0, camping: " Yes", end_date: "2016-08-07"},
  {name: "Wilderness Festival 2016", latitude: 51.8628179, longitude: -1.4922953000000234, start_date: "2016-08-04", date: "August 4-7, 2016", location: "Oxfordshire, UK", website: "http://www.wildernessfestival.com/", description: "Welcome to an award winning festival of music, food, learning, literature and rejuvenation. Set amongst the lakes, forests and parkland of Oxfordshire’s exquisite Cornbury Estate, Wilderness is an inspirational weekend for all the ages.\r\n", price: 0, camping: " Yes", end_date: "2016-08-07"},
  {name: "Arenal Sound 2016", latitude: 39.8677391, longitude: -0.06555849999995189, start_date: "2016-08-04", date: "August 4-7, 2016", location: "Burriana, Spain", website: "http://www.arenalsound.com/en/", description: nil, price: 0, camping: " Yes", end_date: "2016-08-07"},
  {name: "Solar Weekend 2016", latitude: 51.2054534, longitude: 5.975850799999989, start_date: "2016-08-04", date: "August 4-7, 2016", location: "Roermond, Netherlands", website: "http://www.solarweekend.com/nl/blog", description: nil, price: 0, camping: " Yes", end_date: "2016-08-07"},
  {name: "Smukfest 2016", latitude: 56.03724700000001, longitude: 9.929798900000037, start_date: "2016-08-03", date: "August 3-7, 2016", location: "Skanderborg, Denmark", website: "http://www.smukfest.dk/", description: nil, price: nil, camping: " Yes", end_date: "2016-08-07"},
  {name: "OFF Festival 2016", latitude: 50.26489189999999, longitude: 19.02378150000004, start_date: "2016-08-05", date: "August 5-7, 2016", location: "Katowice, Poland", website: "http://off-festival.pl/", description: "Still unspoiled by hordes of backpackers, Poland is a treat for travelers. And nothing makes that treat sweeter than the similarly unspoiled OFF Festival in Katowice which after ten years still keeps its lineup fresh and surprising. \r\n", price: 0, camping: " Yes", end_date: "2016-08-07"},
  {name: "Outside Lands 2016", latitude: 37.769421, longitude: -122.48621400000002, start_date: "2016-08-05", date: "August 5-7, 2016", location: "San Francisco, CA", website: "http://www.sfoutsidelands.com/home/", description: "A bike valet, wine tasting tent, and local organic food vendors are just a couple of signs that you’re in San Francisco at Outside Lands. The quirky and wonderful Golden Gate Park hosts a wide range of acts and has quickly grown into a highlight of the San Fran summer. Bring a hoodie with you. Just because it’s August doesn’t mean that the fog won’t join the party. \r\n", price: nil, camping: " No", end_date: "2016-08-07"},
  {name: "Watershed Festival 2016", latitude: 0.0, longitude: 0.0, start_date: "2016-07-29", date: "July 29-31 and August 5-7, 2016", location: "George, WA", website: "http://www.watershedfest.com", description: nil, price: nil, camping: " Yes", end_date: "2016-08-07"},
  {name: "Telluride Jazz Festival 2016", latitude: 37.9374939, longitude: -107.81228520000002, start_date: "2016-08-05", date: "August 5-7, 2016", location: "Telluride, CO", website: "http://telluridejazz.org/", description: " Laid back showcase of the best in jazz, funk, soul and eclectic world music with the beautiful Telluride aesthetic as the background. \r\n", price: 0, camping: " Yes", end_date: "2016-08-07"},
  {name: "Forgotten Fields 2016", latitude: 51.0996537, longitude: 0.2333777999999711, start_date: "2016-08-05", date: "August 5-7, 2016", location: "Tunbridge Wells, UK", website: "http://forgottenfields.co.uk/", description: nil, price: 0, camping: " Yes", end_date: "2016-08-07"},
  {name: "Vertex Festival 2016", latitude: 38.8422178, longitude: -106.1311288, start_date: "2016-08-05", date: "August 5-7, 2016", location: "Buena Vista, CO", website: "http://www.vertexfestival.com/", description: "Vertex’s vision is inspired by its majestic high elevation home where sky meets peaks, peaks meet valleys, and valleys meet rivers. The venue is nestled in sprawling rangeland at the foot of the Continental Divide and surrounded by the year-round snowcapped 14,000-foot peaks of the Collegiate Mountain Range. The festival site is known as Cottonwood Meadows, a recently revitalized working ranch located a mile from downtown Buena Vista, Colorado in Chaffee County. \r\n", price: nil, camping: " Yes", end_date: "2016-08-07"},
  {name: "Shambhala 2016", latitude: 49.194892, longitude: -117.27927690000001, start_date: "2016-08-05", date: "August 5-8, 2016", location: "Salmo, BC", website: "http://www.shambhalamusicfestival.com/", description: "At this point, Canada’s favorite DIY festival lives in a class by itself. Consistently chosen by fans as their favorite festival of the summer, this five day camping marathon features a wide array of music and art set admist the beautiful BC backcountry. It’s not a surprise that Shambhala is leading the way as a transformational festival. \r\n", price: 0, camping: " Yes", end_date: "2016-08-08"},
  {name: "Punk Rock Holiday 2016", latitude: 46.1857188, longitude: 13.731983799999966, start_date: "2016-08-09", date: "August 9-12, 2016", location: "Tolmin, Slovenia", website: "http://www.punkrockholiday.com/", description: nil, price: 0, camping: " Yes", end_date: "2016-08-12"},
  {name: "Brutal Assault 2016", latitude: 50.090022, longitude: 14.41803040000002, start_date: "2016-08-10", date: "August 10-13, 2016", location: "Prague, Czech", website: "http://brutalassault.cz/en/", description: nil, price: 72, camping: " Yes", end_date: "2016-08-13"},
  {name: "Eaux Claires 2016", latitude: 44.811349, longitude: -91.49849410000002, start_date: "2016-08-12", date: "August 12-13, 2016", location: "Eau Claire, WI", website: "http://eauxclaires.com/", description: nil, price: 0, camping: " Yes", end_date: "2016-08-13"},
  {name: "Dance Valley 2016", latitude: 52.4520591, longitude: 4.630586999999991, start_date: "2015-08-13", date: "August 13, 2015", location: "Velsen, The Netherlands", website: "http://dancevalley.com/", description: "Dance Valley is one the longest running Outdoor Dance Events of The Netherlands. Every year the first weekend of August the place of Spaarnwoude transforms to one of the biggest festival grounds of the summer.\r\n", price: nil, camping: " No", end_date: "2015-08-13"},
  {name: "Into The Grave 2016", latitude: 53.1920803, longitude: 5.796973699999967, start_date: "2016-08-12", date: "August 12-13, 2016", location: "Leeuwarden, The Netherlands", website: "http://intothegrave.nl/", description: nil, price: 47, camping: " No", end_date: "2016-08-13"},
  {name: "Oya Festival 2016", latitude: 59.9138688, longitude: 10.752245399999993, start_date: "2016-08-09", date: "August 9-13, 2016", location: "Oslo, Norway", website: "http://oyafestivalen.com/", description: nil, price: 0, camping: " No", end_date: "2016-08-13"},
  {name: "Way Out West 2016", latitude: 57.70887, longitude: 11.974559999999997, start_date: "2016-08-11", date: "August 11-13, 2016", location: "Goteborg, Sweden", website: "http://wayoutwest.se/", description: nil, price: 1640, camping: " Yes", end_date: "2016-08-13"},
  {name: "A Summer’s Tale Festival 2016", latitude: 53.21833299999999, longitude: 10.191944000000035, start_date: "2016-08-10", date: "August 10-13 ,2016", location: "Luhmühlen, Germany", website: "http://www.asummerstale.de/en/", description: "Between deep forests, quaint moors, light birch groves and wide heath fields, A Summer's Tale invites you from 5th to 8th August 2015 to four days full of music, art and relaxation. Located in the North of Lueneburger Heide, along the small creek Luhe, doors will open for an eclectic festival programme. Comfort and culinary pleasures complement the range. Your senses can dwell blissfully here .\r\n", price: 0, camping: " Yes", end_date: "2016-08-13"},
  {name: "Strom 2016", latitude: 55.6760968, longitude: 12.568337100000008, start_date: "2016-08-06", date: "August 6-13, 2016", location: "Copenhagen, Denmark", website: "http://www.stromcph.dk/", description: "Strøm’s vision is through activities, sparring and networks to support, strengthen and unite the Danish electronic music scene. With a focus on quality, Strøm means to spread awareness of electronic music as well as positioning Copenhagen regionally, nationally and internationally as home to a significant and leading electronic music culture, through training (such as workshops, master classes and artist talks) as well as events like concerts and raves in locations both well known and new to electronic music culture.\r\n", price: nil, camping: " No", end_date: "2016-08-13"},
  {name: "Boomtown Fair 2016", latitude: 51.05769480000001, longitude: -1.3080628999999817, start_date: "2016-08-11", date: "August 11-14, 2016", location: "Hampshire, UK", website: "http://www.boomtownfair.co.uk/", description: "BoomTown rose up from the underground seven annual Chapters ago to become one of the UK’s wildest and most inspiring independent festivals. A sprawling metropolis and home to every species of creative miscreant, its thousands of citizens embark on an immersive audio visual journey of discovery, dancing through its labyrinthine streets and plazas on a non stop weekend joyride to a soundtrack of ska, folk, gypsy, reggae, world, punk, pirate, disco, electro-swing, jazz, blue-grass, breaks, bass, jungle, techno and all in a spirit of unity and freedom! \r\n", price: 0, camping: " Yes", end_date: "2016-08-14"},
  {name: "Flow Festival 2016", latitude: 60.17332440000001, longitude: 24.941024800000037, start_date: "2016-08-12", date: "August 12-14, 2016", location: "Helsinki, Finland", website: "http://www.flowfestival.com/", description: "MUSIC PRESENTED AT FLOW IS A STRONG AND VARIED SELECTION OF UP AND COMING AND ESTABLISHED ARTISTS FROM INDIE-ROCK TO SOUL AND JAZZ AND FROM FOLK TO CONTEMPORARY CLUB SOUNDS, BOTH FROM THE FINNISH AND THE INTERNATIONAL SCENE. ALONGSIDE INTERESTING AND TOPICAL MUSIC, FLOW IS ABOUT URBAN SPACES, VISUAL ARTS, COSY DECORATION, GOOD FOOD AND DRINK.\r\n", price: 0, camping: " No", end_date: "2016-08-14"},
  {name: "Bloodstock 2016", latitude: 52.7354375, longitude: -1.6960724000000482, start_date: "2016-08-11", date: "August 11-14, 2016", location: "Derbyshire, UK", website: "http://www.bloodstock.uk.com/", description: "BLOODSTOCK boasts over 100 international rock and metal acts across four stages, as well as other attractions including a huge international metal market, late night entertainment in the Sophie Lancaster Tent, fairground rides, ‘The Bloodstock Arms’ festival bar serving real ale, full weekend camping and one of the best atmospheres the festival scene has to offer. Add to this a signing tent where you can meet your favourite bands, and for those of you who need those extra creature comforts - an extra special VIP experience in the Serpents Lair camping and hospitality backstage bar, which offers 80+ different real ales, this really is an unmissable date in the headbangers calendar. Metal brethren at your marks!\r\n", price: 0, camping: " Yes", end_date: "2016-08-14"},
  {name: "M’era Luna 2016", latitude: 52.154778, longitude: 9.95796519999999, start_date: "2016-08-13", date: "August 13-14, 2016", location: "Hildesheim, Germany", website: "http://www.meraluna.de/en/", description: nil, price: 94, camping: " Yes", end_date: "2016-08-14"},
