  {name: "Brussels Summer Festival 2016", latitude: 50.8503396, longitude: 4.351710300000036, start_date: "2016-08-05", date: "August 5-14, 2016", location: "Brussels, Belgium", website: "http://www.bsf.be/", description: "The BSF is firstly a music festival, but it's not like any other. It features a host of different styles, tickets are very reasonably priced, and it's uniquely located in the royal quarter of Brussels. The BSF is a different kind of festival!\r\n", price: nil, camping: " No", end_date: "2016-08-14"},
  {name: "The Wrecking Ball 2016", latitude: 33.7489954, longitude: -84.3879824, start_date: "2016-08-12", date: "August 12-14, 2016", location: "Atlanta, GA", website: "http://wreckingballatl.com/", description: "Welcome to The Wrecking Ball 2015. Legendary live music venue, the Masquerade, long a fixture on the Atlanta musical landscape and destination point on the national touring scene, marks it’s 25th Anniversary of presenting the finest in new, cutting edge live entertainment by debuting an annual weekend celebration of music we love by artists we admire. For the inaugural 2015 installment of the Wrecking Ball, we give you 60 bands on 4 stages over a period of two days- August 8th and 9th. Heaven, Hell, Purgatory and the outdoor Masquerade Music Park will each host a full slate of artists both days. Stylistically, Rock, Punk Rock, Hardcore, Post-Hardcore, Emo, and all of the flavors in between will be represented\r\n", price: nil, camping: " No", end_date: "2016-08-14"},
