  {name: "Folks Festival 2016", latitude: 40.2247075, longitude: -105.27137800000003, start_date: "2016-08-19", date: "August 19-21, 2016", location: "Lyons, CO", website: "http://www.bluegrass.com/folks/", description: "Lyons locals often look forward to the Folks Festival as their time to finally relax and enjoy summer. In contrast to the hot licks and hyper tempos of RockyGrass, the mellower moods of Folks Fest are the perfect antidote for the warm Colorado sun. Claim your space with a blanket or tarp, set down your low-back chair, and settle in for unforgettable days of music.\r\n", price: 0, camping: " Yes", end_date: "2016-08-21"},
  {name: "Salmon Arm Roots & Blues 2016", latitude: 50.7001034, longitude: -119.2838443, start_date: "2016-08-19", date: "August 19-21, 2016", location: "Salmon Arm, BC", website: "http://www.rootsandblues.ca/", description: "The Festival features a profusion of roots, blues, folk, dance, and world music on five outdoor stages. Also featured: Beer gardens with stage views, Global Food Village, Artisan Market, Workshops, Family Fun Zone (kids 12 and under free).  The Salmon Arm Roots and Blues Festival has become one of the best festivals in Western Canada and now includes a week of pre-fest satellite concerts under our outreach project, Routes & Blues. Come and experience the beautiful BC interior and make the festival one of your stops.\r\n", price: 0, camping: " Yes", end_date: "2016-08-21"},
