  {name: "Philadelphia Folk Festival 2016", latitude: 40.2907756, longitude: -75.44029929999999, start_date: "2016-08-18", date: "August 18-21, 2016", location: "Upper Salford Township, PA", website: "http://www.pfs.org/folk-festival", description: "The Philadelphia Folk Festival began in 1962 and is the largest and longest-running Festival of its kind in the country. The event is unique in that it is presented by a non-profit arts education organization, the Philadelphia Folksong Society, and is operated with the help of 2,500 dedicated volunteers.  Since its inception, the Philadelphia Folk Festival has been the primary fund raising event for the Philadelphia Folksong Society. Founded as a 501(c) 3 non-profit, educational organization in 1957, PFS provides programs of presentation, education, and participation.\r\n", price: 0, camping: " Yes", end_date: "2016-08-21"},
  {name: "Doune the Rabbit Hole 2016", latitude: 56.1524758, longitude: -4.257832000000008, start_date: "2016-08-19", date: "August 19-21, 2016", location: "Stirlingshire, Scotland", website: "http://www.dounetherabbithole.co.uk/", description: "Doune the Rabbit Hole is an intimate, independent music & arts festival located amidst the glorious ancient oak trees of the Cardross Estate, near (Scotland’s ONLY) Lake of Menteith, in Stirlingshire. We started life in 2010, at a site near the town of Doune (hence the name!) and for the last 6 years have been celebrating the very best of Scotland’s independent/DIY arts scene alongside amazing international guests.\r\n", price: 0, camping: " Yes", end_date: "2016-08-21"},
