  {name: "Just So Festival 2016", latitude: 53.23263439999999, longitude: -2.610315700000001, start_date: "2016-08-19", date: "August 19-21, 2016", location: "Cheshire, UK", website: "http://www.justsofestival.org.uk/", description: "The festival provides a magical experience where art, music and literature are embedded and entwined in a beautiful and wonderous landscape. We provide a broad range of musical, theatrical, visual and aural performances, workshops and installations within a safe, natural and magical setting. Every clearing and glade holds a new way to unleash creativity. Families discover and delight in the spectacular within the woodland environment during this spectacular weekend event.\r\n", price: 0, camping: " Yes", end_date: "2016-08-21"},
  {name: "Summer Sonic 2016", latitude: 35.6894875, longitude: 139.69170639999993, start_date: "2016-08-20", date: "August 20-21, 2016", location: "Tokyo/Osaka, Japan", website: "http://www.summersonic.com/2013/", description: nil, price: 16, camping: " No", end_date: "2016-08-21"},
