  {name: "Electric Fields 2016", latitude: 55.2736508, longitude: -3.8086895999999797, start_date: "2016-08-26", date: "August 26-27, 2016", location: "Thornhill, UK", website: "http://www.electricfieldsfestival.com/", description: nil, price: 0, camping: " Yes", end_date: "2016-08-27"},
  {name: "Creamfields 2016", latitude: 53.340517, longitude: -2.6246267000000216, start_date: "2016-08-25", date: "August 25-28, 2016", location: "Daresbury, UK", website: "http://www.creamfields.com/", description: "Creamfields is the world's leading dance music festival. Born in 1998, the original dance festival set out to provide the clubbing world with a bespoke large scale outdoor event and has gone on to become the most popular and renowned open air electronic music festival in the world.\r\n", price: 0, camping: " Yes", end_date: "2016-08-28"},
  {name: "Mysteryland Netherlands 2016", latitude: 52.29049089999999, longitude: 4.669537600000012, start_date: "2016-08-27", date: "August 27-28, 2016", location: "Haarlemmermeer, Netherlands", website: "http://www.mysteryland.nl/nl/", description: "Mysteryland is the longest running electronic music festival in the world. The festival – which focuses on music, culture, arts, talent and sustainability, brings visitors to inspiring and surprising worlds. Mysteryland is awarded by Julie’s Bicycle with a ‘3-Star Industry Green Certificate’, the highest predicate for sustainability in the creative, arts, music and theatre industry. The festival is also prized with three stars from ‘A Greener Festival Award’. \r\n", price: nil, camping: " Yes", end_date: "2016-08-28"},
  {name: "Reading Festival 2016", latitude: 51.4542645, longitude: -0.9781302999999753, start_date: "2016-08-26", date: "August 26-28, 2016", location: "Reading, UK", website: "http://www.readingfestival.com/", description: "The infamous Reading & Leeds Festival is heralded as the best music show on the planet. With the most revered artists from across the globe playing each year across the August Bank Holiday weekend, it is a genuine rite of passage for discerning music lovers everywhere.\r\n", price: 0, camping: " Yes", end_date: "2016-08-28"},
