  {name: "Bumbershoot 2016", latitude: 47.6062095, longitude: -122.3320708, start_date: "2016-09-02", date: "September 2-4, 2016", location: "Seattle, WA", website: "http://bumbershoot.org/", description: "Now in its fourth decade, Bumbershoot (a oldie time word for umbrella) is more of an institution than a music festival. There’s so much happening here that you’ll need all three days to sort through all the live music, art shows, speakers, and exhibitions happening under the Bumbershoot. With a budget friendly price (and children under ten are FREE), this fest is one of the most affordable and family friendly of the season.\r\n", price: nil, camping: " No", end_date: "2016-09-04"},
