  {name: "Backwoods Music Festival 2016", latitude: 35.8209798, longitude: -96.8064594, start_date: "2016-09-02", date: "September 2-4, 2016", location: "Stroud, OK", website: "http://backwoodsmusicfestival.com/", description: nil, price: 0, camping: " Yes", end_date: "2016-09-04"},
  {name: "Bingley Music Live 2012", latitude: 53.847389, longitude: -1.8337810000000445, start_date: "2016-09-02", date: "September 2-4, 2016", location: "Bingley, UK", website: "http://www.bingleymusiclive.com/", description: "With a 16,000 daily capacity BML is one of the most intimate and much loved festivals on the circuit bringing together people from all walks of life into beautiful surroundings with the sole purpose of having a good time. \r\n", price: 0, camping: " Yes", end_date: "2016-09-04"},
  {name: "One Love Festival 2016", latitude: 51.61361729999999, longitude: 0.13174930000002405, start_date: "2016-09-02", date: "September 2-4, 2016", location: "London, UK", website: "http://www.onelovefestival.co.uk/", description: "We have established a wonderful growing customer base of Fun, Loving, Happy and loyal Fans from all over Europe and beyond. Each year the festival grows organically both in production and vision – but still keeping to the original vibe of a intimate fun and FAMILY friendly event.\r\n", price: nil, camping: " Yes", end_date: "2016-09-04"},
  {name: "Burning Man 2016", latitude: 40.910733, longitude: -119.0560102, start_date: "2016-08-28", date: "August 28- September 5, 2016", location: "Black Rock Desert, NV", website: "http://burningman.com/", description: "Trying to explain what Burning Man is to someone who has never been to the event is a bit like trying to explain what a particular color looks like to someone who is blind. There are no rules about how one must behave or express oneself at this event (save the rules that serve to protect the health, safety, and experience of the community at large); rather, it is up to each participant to decide how they will contribute and what they will give to this community. The event takes place on an ancient lakebed, known as the playa. By the time the event is completed and the volunteers leave, sometimes nearly a month after the event has ended, there will be no trace of the city that was, for a short time, the most populous town in the entire county.\r\n", price: nil, camping: " Yes", end_date: "2016-09-05"},
  {name: "End of the Road Festival 2016", latitude: 50.946125, longitude: -2.087874000000056, start_date: "2016-09-04", date: "September 4-6, 2016", location: "North Dorset, UK", website: "http://endoftheroadfestival.com/", description: nil, price: 0, camping: " Yes", end_date: "2016-09-06"},
  {name: "Bestival 2016", latitude: 50.686193, longitude: -1.243359000000055, start_date: "2016-09-08", date: "September 8-11, 2016", location: "Isle of Wight, UK", website: "http://www.bestival.net/", description: nil, price: 0, camping: " Yes", end_date: "2016-09-11"},
  {name: "Lollapalooza Berlin 2016", latitude: 52.4575526, longitude: 13.391103199999975, start_date: "2016-09-10", date: "September 10-11, 2016", location: "Berlin, Germany", website: "http://www.lollapaloozade.com/", description: nil, price: 0, camping: " No", end_date: "2016-09-11"},
  {name: "Groovefest Dominican Republic 2016", latitude: 19.7807686, longitude: -70.68710909999999, start_date: "2016-09-04", date: "September 4-11, 2016", location: "Puerto Plata, Dominican Republic", website: "http://www.groovefestevents.com/", description: "Now with a global reputation for being far and above the most relaxing, tropical and magical musical gathering of them all, Groovefest is not your normal festival experience. It is a luxury dance music event spread across a whole week in the Caribbean island of the Dominican Republic at Puerto Plata's all inclusive and premier vacation resort.\r\n", price: nil, camping: " No", end_date: "2016-09-11"},
  {name: "Dancefestopia 2016", latitude: 39.1041725, longitude: -94.59985169999999, start_date: "2016-09-09", date: "September 9-11, 2016", location: "Kansas City, MO", website: "http://www.dancefestopia.com", description: "DANCEFESTOPIA 2014 PRESENTS AN ENHANCED HIGH-ENERGY LINEUP WITH THE BIGGEST NAMES IN THE MUSIC INDUSTRY. PREPARE FOR A SENSORY OVERLOAD AS THE STAGES LIGHT UP THE SKY AND PERFORMERS ROCK THE CROWD.\r\n", price: 0, camping: " Yes", end_date: "2016-09-11"},
  {name: "KAABOO 2016", latitude: 32.976349, longitude: -117.262809, start_date: "2016-09-16", date: "September 16-18, 2016", location: "San Diego, CA", website: "http://www.kaabooexperience.com/", description: "Forget what you know about music festivals. This is a music experience. A completely curated three-day sound voyage that combines rock-n-roll music and tastemaking socials into a modern wonderland on the warm shores of the Pacific. Where every detail is crafted for your enjoyment and you bask in world-class music, incredible cuisine, craft libations, comedy acts, contemporary art, dancing and premium amenities. This is your escape to the perfect weekend. \r\n", price: 0, camping: " No", end_date: "2016-09-18"},
  {name: "FreshGrass Festival 2016", latitude: 42.7020206, longitude: -73.11587420000001, start_date: "2016-09-16", date: "September 16-18, 2016", location: "North Adams, MA", website: "http://freshgrass.com/", description: "FreshGrass is a wonderland of traditional and cutting-edge bluegrass, tucked appropriately into a 19th-century factory turned 21st-century museum in the Berkshire mountains of northwestern Massachusetts. An opportunity for enthusiasts to both appreciate and participate, FreshGrass is family-friendly and brimming with the brightest talent not just on our four stages, but also in our galleries, brick-lined courtyards, and grassy fields. \r\n", price: nil, camping: " Yes", end_date: "2016-09-18"},
  {name: "Oasis Festival 2016", latitude: 31.63, longitude: -8.008888999999954, start_date: "2016-09-16", date: "September 16-18, 2016", location: "Marrakech, Morocco", website: "http://www.theoasisfest.com/", description: "An intimate, destination festival featuring today’s top underground electronic talent. It's time to dance somewhere different. \r\n", price: 0, camping: " No", end_date: "2016-09-18"},
  {name: "Telluride Blues and Brews 2016", latitude: 37.9374939, longitude: -107.81228520000002, start_date: "2016-09-16", date: "September 16-18, 2016", location: "Telluride, CO", website: "http://www.tellurideblues.com/", description: "BLUES & BREWS IS A THREE-DAY CELEBRATION OF LIVE MUSIC AND MICROBREWS HELD AT TELLURIDE TOWN PARK, NESTLED IN THE VALLEY OF STUNNING 13,000-FOOT MOUNTAIN PEAKS. THE FESTIVAL OFFERS AN ECLECTIC MIX OF LIVE BLUES, FUNK, JAM BAND, ROCK, GOSPEL AND SOUL PERFORMANCES, AND SOME OF THE BEST MICROBREWERIES IN THE COUNTRY, WITH A WIDE VARIETY OF FOOD AND CRAFT VENDORS, CHILDREN'S ACTIVITIES, LATE NIGHT SHOWS, AND MUCH MORE.\r\n", price: nil, camping: " Yes", end_date: "2016-09-18"},
  {name: "Sundown Music Festival 2016", latitude: 33.660297, longitude: -117.99922650000002, start_date: "2016-09-17", date: "September 17-18, 2016", location: "Huntington Beach, CA", website: "http://sundownmusicfest.com/", description: nil, price: nil, camping: " No", end_date: "2016-09-18"},
  {name: "Liverpool Psych Fest 2016", latitude: 53.4083714, longitude: -2.9915726000000404, start_date: "2016-09-23", date: "September 23-24, 2016", location: "Liverpool, UK", website: "http://www.liverpoolpsychfest.com/", description: "Liverpool International Festival of Psychedelia is a pan-continental celebration of audio-futurists, operating at the bleeding edge of today’s psychedelic renaissance. For two days each September, Liverpool’s former industrial heartland beats once more, to motorik throb and shimmering drone, a kaleidoscopic celebration of our global psychedelic village. The festival was lauded across its first three installments (2012, 2013 and 2014) for its unique take on a thoroughly modern psychedelic condition, with The Guardian declaring “Liverpool, the great psychedelic capital of Europe”.\r\n", price: 0, camping: " No", end_date: "2016-09-24"},
  {name: "Animal Collective Camping Weekend 2016", latitude: 36.2704212, longitude: -121.807976, start_date: "2016-09-23", date: "September 23-24, 2016", location: "Big Sur, CA", website: "http://folkyeah.com/#/ac2016bigsur/", description: nil, price: nil, camping: " Yes", end_date: "2016-09-24"},
  {name: "Pop Montreal 2016", latitude: 45.5016889, longitude: -73.56725599999999, start_date: "2016-09-21", date: "September 21-25, 2016", location: "Montreal, QC", website: "http://popmontreal.com/", description: "Wonderfully weird and beautifully under-appreciated, Pop Montreal is your best excuse to visit the city in the fall. Venues are scattered across the city from the largest clubs to unique venues (parks and cathedrals) to a single dude singing in the back of a vintage clothing store. And when you need a break from the crowds and music, it’s easy to slip into one of Montreal’s amazing restaurants or bars.  \r\n", price: nil, camping: " No", end_date: "2016-09-25"},
  {name: "Pilgrimage Music Festival 2016", latitude: 35.9334016, longitude: -86.86185360000002, start_date: "2016-09-24", date: "September 24-25, 2016", location: "Franklin, TN", website: "http://pilgrimagefestival.com/", description: nil, price: nil, camping: " No", end_date: "2016-09-25"},
  {name: "Austin City Limits 2016", latitude: 30.266962, longitude: -97.77285899999998, start_date: "2016-09-30", date: "September 30-October 9, 2016", location: "Austin, TX", website: "http://www.aclfestival.com/", description: "Named after the venerable PBS series, the Austin City Limits Festival heads into its second decade stronger than ever. The traditional lineup announcement leads to a flurry of praise and criticism from the hip kids, but the love for this festival is so strong that ACL added a second weekend.\r\n", price: nil, camping: " No", end_date: "2016-10-09"},
  {name: "Joshua Tree Fall 2016", latitude: 34.2058757, longitude: -116.24689569999998, start_date: "2016-10-06", date: "October 6-9, 2016", location: "Joshua Tree, CA", website: "http://joshuatreemusicfestival.com/index.html", description: "These independently produced music festivals are held annually in the shadows of the infamous National Park. They are two (of the very few) multi-day campout music festivals in Southern California featuring live music. Music lovers of all ages enjoy this phenomenal live music in an intimate setting and magical surroundings. The spring festival features an eclectic line up of performers; dance-world-electro-funk'n groove. The fall fest differs musically with artists of the more rootsicana-newgrassy-folkadelic realms. The two different musical stylings create distinct audiences at the festivals, but many folks do attend both. The town of Joshua Tree is located in the high desert of the magical Mojave, 50 minutes from Palm Springs, 2.5 hour drive from LA, 3 from San Diego, 3.5 from Vegas, and 5 from Phoenix, at the entrance to the world renowned national park. \r\n", price: 0, camping: " Yes", end_date: "2016-10-09"},
  {name: "Amsterdam Dance Event 2016", latitude: 52.3702157, longitude: 4.895167899999933, start_date: "2016-10-19", date: "October 19-23, 2016", location: "Amsterdam, The Netherlands", website: "http://www.amsterdam-dance-event.nl/", description: "THE AMSTERDAM DANCE EVENT (ADE) IS THE WORLD'S LEADING ELECTRONIC MUSIC CONFERENCE AND THE BIGGEST CLUB FESTIVAL FOR THE MANY ELECTRONIC SUB-GENRES ON THE PLANET. THE EVENT OFFERS A FULL PROGRAM OF DAYTIME CONFERENCES, INCLUDING INTERACTIVE WORKSHOPS, MENTORING SESSIONS, TECHNICAL DEMONSTRATIONS AND IN-DEPTH ROUND-TABLE DISCUSSIONS, ALONGSIDE A NIGHTTIME MUSIC FESTIVAL FEATURING MORE THAN 220 EVENTS OVER FIVE DAYS IN 52 VENUES AROUND THE CITY. EACH YEAR, THE ADE ATTRACTS OVER 3,000 BUSINESS PROFESSIONALS AND 140,000 FESTIVAL VISITOR'S INCLUDING 30,000 TOURISTS - FROM 62 COUNTRIES.\r\n", price: nil, camping: " No", end_date: "2016-10-23"},
  {name: "Voodoo Experience 2016", latitude: 29.95106579999999, longitude: -90.0715323, start_date: "2016-10-28", date: "October 28-30, 2016", location: "New Orleans, LA", website: "http://worshipthemusic.com/", description: "EVERY YEAR AROUND HALLOWEEN, THOUSANDS GATHER IN NEW ORLEANS FOR THE VOODOO MUSIC EXPERIENCE! THIS MEGA-FEST FEATURES TOURING BANDS ALONG WITH REGIONAL FAVORITES.\r\n", price: nil, camping: " No", end_date: "2016-10-30"},
  {name: "Iceland Airwaves 2016", latitude: 64.133333, longitude: -21.933332999999948, start_date: "2016-11-02", date: "November 2-6, 2016", location: "Reykjavik, Iceland", website: "http://icelandairwaves.is/", description: "The winter heats up in Reykjavik where Music Festival Junkies spend the days taking in the wonders of the island and spending nights at the top clubs in the country. From hipster indie acts to geysers to after-parties, Iceland Airwaves remains a solid bet for a cold weather festival.\r\n", price: nil, camping: " No", end_date: "2016-11-06"},
  {name: "Le Guess Who? 2016", latitude: 52.09073739999999, longitude: 5.121420100000023, start_date: "2016-11-10", date: "November 10-13, 2016", location: " Utrecht, The Netherlands", website: "http://www.leguesswho.nl/", description: nil, price: 0, camping: " No", end_date: "2016-11-13"},
  {name: "Outlook Festival 2016", latitude: 44.8947794, longitude: 13.815615799999932, start_date: "2016-09-02", date: "September 2-6, 2016", location: "Pula, Croatia", website: "http://www.outlookfestival.com/", description: "Outlook Festival is the largest Bass music and Soundsystem Culture festival in Europe, featuring the biggest names from the most vibrant and cutting edge dance scenes around.  When we talk about bass music we don’t mean the bastardised commercial version currently being sold to children, we mean underground dancefloor music, whether it be house, techno, dubstep, reggae, dub, hiphop, garage, grime, electronica.\r\n", price: 0, camping: " Yes", end_date: "2016-09-06"},
  {name: "Snowglobe 2016", latitude: 38.939926, longitude: -119.97718680000003, start_date: "2017-12-29", date: "December 29, 2016-January 1, 2017", location: "South Lake Tahoe, CA", website: "http://snowglobemusicfestival.com/", description: "The annual SnowGlobe in Lake Tahoe has made good on their promise to bring top-notch EDM festival to a ski town. SnowGlobe is loud. It’s flashy. Music shakes your chest. Fireworks explode. Imagine a club filled with thousands of EDM fans dancing and screaming and losing their minds. And it’s outside. In the middle of the winter. \r\n", price: nil, camping: " No", end_date: "2017-01-01"},
  {name: "Shiprocked 2017", latitude: 25.7616798, longitude: -80.19179020000001, start_date: "2017-01-16", date: "January 16-20, 2017", location: "Miami, Fl", website: "http://www.shiprocked.com/", description: "THE ULTIMATE ROCK MUSIC CRUISE VACATION IS PRODUCED BY ALAN KOENIG OF ASK4 ENTERTAINMENT. DURING SHIPROCKED 2015, GUESTS FROM AROUND THE U.S. AND VARIOUS OTHER COUNTRIES WERE TREATED TO MORE THAN 50 PERFORMANCES FROM 25 ARTISTS ON FIVE STAGES ABOARD NORWEGIAN PEARL--AND ON THE SPECTACULAR BEACH STAGE OF GREAT STIRRUP CAY IN THE BAHAMAS--ALONG WITH THREE DAYS OF MEET-AND-GREETS WITH SHIPROCKED ARTISTS, COMEDY AND DJ SETS, IMPROMPTU STAGE-SIDE SIGNINGS, AND MORE.\r\n", price: nil, camping: " No", end_date: "2017-01-20"},
  {name: "The Rock Boat 2017", latitude: 27.95057499999999, longitude: -82.45717760000002, start_date: "2017-02-10", date: "February 10-15, 2017", location: "Tampa, FL", website: "http://www.therockboat.com/", description: "The Rock Boat is back for its 16th voyage! We invite you to join us on a 5-day musical adventure January 26-31, 2016. Set sail aboard Norwegian Pearl as we head from Miami to Costa Maya and Grand Cayman.\r\n", price: nil, camping: " No", end_date: "2017-02-15"}
